INSERT INTO `field_data_body` VALUES ('node','page',0,1774,1774,'und',0,'<p>Please contact us</p>\r\n','','filtered_html'),('node','page',0,1775,1775,'und',0,'<p>Stuff about us</p>\r\n','','filtered_html'),('node','page',0,1776,1776,'und',0,'<p>This is our privacy policy</p>\r\n','','filtered_html'),('node','rental',0,1777,1777,'und',0,'  因为房客有事回国，房间22号可出租。全保安，近一切设施，离情人港2分钟。fish market 3分钟。China Town 15分钟。楼下有bus。\r<br />\r<br />房间内：入墙柜，单人床，书桌等。\r<br />\r<br />超友善房东\r<br />\r<br />水电煤全包。\r<br />\r<br />房子三房只住4人，家里同屋都爱安静。所以晚上不会吵。\r<br />\r<br />\r<br />\r<br />\r<br />',NULL,'full_html'),('node','rental',0,1778,1778,'und',0,'\r<br />',NULL,'full_html'),('node','rental',0,1779,1779,'und',0,'  St Leonards 【北悉尼】【全新高档时尚公寓】 2012年完工\r<br />\r<br />&#8226; &#160;  &#160;两房一厅一卫，超大阳台\r<br />&#8226; &#160;  &#160;大双人房出租： 单人$250，双人$280/w，长租短租都可以。\r<br />&#8226; &#160;  (朝北，阳光充足，宽敞明亮舒适，无限流量宽带，新家具，新床垫，新家电，新空调)\r<br />&#8226; &#160;  &#160;友善学生房东住另一间小房间。\r<br />&#8226; &#160;  &#160;厨房客厅共用，客厅不住人，整套公寓只住你和他两个人。\r<br />\r<br />&#8226; &#160;  &#160; 距离火车站仅300米，3分钟一班火车\r<br />&#8226; &#160;  &#160; 到 Chatswood 5分钟\r<br />&#8226; &#160;  &#160; 到 City 15分钟\r<br />&#8226; &#160;  &#160; 到 Macquarie Uni 15分钟\r<br />\r<br />&#8226; &#160;  &#160; 小区前有超大公园，环境优美，走几步就是森林，海边～～\r<br />&#8226; &#160;  &#160; St Leonards 是下北岸富人区，本小区24小时监控，电子门卡出入，非常安全。\r<br />&#8226; &#160;  &#160; 屋内：大品牌全新的家用电器设备，超高速网络，无限流量～\r<br />\r<br />&#8226; &#160;  &#160; 有 Coles 和 Woolworths，药店，银行，邮局，面包房，咖啡店，书报店，水果店～\r<br />&#8226; &#160;  &#160; 几十家饭店，中日韩泰、意法越澳、烤和牛肉，拉面，咖喱，披萨，西餐，寿司，刺身，快餐，甜品，家常菜，想吃的都有～\r<br />\r<br />0410-168-909 Paul\r<br />qq: 674605982\r<br />可短信联系，预约看房，即日起可以入住',NULL,'full_html'),('node','rental',0,1780,1780,'und',0,'\r<br />',NULL,'full_html'),('node','rental',0,1781,1781,'und',0,'\r<br />',NULL,'full_html'),('node','rental',0,1782,1782,'und',0,'  花园式公寓，空气清新，鸟语花香，3房unit一房出租，自带卫浴，自带小阳台，客厅绝不住人，小区内部85%以上都是外国人，露天游泳池，（可与鬼妹一同在烈日下裸晒）环境优雅，设施齐全，全砖隔音隔热，冬暖夏凉。包水，电，煤，无线下载，客厅穿堂儿风，即日起拎包入住。注：不短租，半年起步，先付磅金2星期+房租2星期，单人$