module disabled.','','none'),(2751,'','default','Status message','','7.23'),(2752,'','default','Unable to determine the type of the source directory.','','none'),(2753,'','default','Cannot determine the type of project.','','none'),(2754,'','default','Fatal error in update, cowardly refusing to wipe out the install directory.','','none'),(2755,'','default','File Transfer failed, reason: !reason','','none'),(2756,'','default','Unable to create %directory due to the following: %reason','','none'),(2757,'','default','Drupal could not be correctly setup with the existing database. Revise any errors.','','none'),(2758,'','default','No feeds available. <a href=\"@link\">Add feed</a>.','','none'),(2759,'','default','No categories available. <a href=\"@link\">Add category</a>.','','none'),(2760,'','default','The length of time between feed updates. Requires a correctly configured <a href=\"@cron\">cron maintenance task</a>.','','none'),(2761,'','default','News items in block','','none'),(2762,'','default','Drupal can make a block with the most recent news items of this feed. You can <a href=\"@block-admin\">configure blocks</a> to be displayed in the sidebar of your page. This setting lets you configure the number of news items to show in this feed\'s block. If you choose \'0\' this feed\'s block will be disabled.','','none'),(2763,'','default','The URL %url is invalid. Enter a fully-qualified URL, such as http://www.example.com/feed.xml.','','none'),(2764,'','default','A feed named %feed already exists. Enter a unique title.','','none'),(2765,'','default','A feed with this URL %url already exists. Enter a unique URL.','','none'),(2766,'','default','Upload an OPML file containing a list of feeds to be imported.','','none'),(2767,'','default','OPML Remote URL','','none'),(2768,'','default','Enter the URL of an OPML file. This file will be downloaded and processed only once on submission of the form.','','none'),(2769,'','default','Drupal can make a block with the most recent news items of a feed. You can <a href=\"@block-admin\">configure blocks</a> to be displayed in the sidebar of your page. This setting lets you configure the number of news items to show in a feed\'s block. If you choose \'0\' these feeds\' blocks will be disabled.','','none'),(2770,'','default','You must <em>either</em> upload a file or enter a URL.','','none'),(2771,'','default','This URL is not valid.','','none'),(2772,'','default','No new feed has been added.','','none'),(2773,'','default','The URL %url is invalid.','','none'),(2774,'','default','A feed named %title already exists.','','none'),(2775,'','default','A feed with the URL %url already exists.','','none'),(2776,'','default','Fetchers download data from an external source. Choose a fetcher suitable for the external source you would like to download from.','','none'),(2777,'','default','Parsers transform downloaded data into standard structures. Choose a parser suitable for the type of feeds you would like to aggregate.','','none'),(2778,'','default','Processors act on parsed feed data, for example they store feed items. Choose the processors suitable for your task.','','none'),(2779,'','default','For most aggregation tasks, the default settings are fine.','','none'),(2780,'','default','A category named %category already exists. Enter a unique title.','','none'),(2781,'','default','Default fetcher','','none'),(2782,'','default','Downloads data from a URL using Drupal\'s HTTP request handler.','','none'),(2783,'','default','Default parser','','none'),(2784,'','default','Parses RSS, Atom and RDF feeds.','','none'),(2785,'','default','Default processor','','none'),(2786,'','default','Creates lightweight records from feed items.','','none'),(2787,'','default','Default processor settings','','none'),(2788,'','default','Number of items shown in listing pages','','none'),(2789,'','default','Requires a correctly configured <a href=\"@cron\">cron maintenance task</a>.','','none'),(2790,'','default','Select categories using','','none'),(2791,'','default','For a small number of categories, checkboxes are easier to use, while a multiple selector works well with large numbers of categories.','','none'),(2792,'','default','Length of trimmed description','','none'),(2793,'','default','The maximum number of characters used in the trimmed version of content.','','none'),(2794,'','default','The Aggregator module is an on-site syndicator and news reader that gathers and displays fresh content from RSS-, RDF-, and Atom-based feeds made available across the web. Thousands of sites (particularly news sites and blogs) publish their latest headlines in feeds, using a number of standardized XML-based formats. For more information, see the online handbook entry for <a href=\"@aggregator-module\">Aggregator module</a>.','','none'),(2795,'','default','Viewing feeds','','none'),(2796,'','default','Feeds contain published content, and may be grouped in categories, generally by topic. Users view feed content in the <a href=\"@aggregator\">main aggregator display</a>, or by <a href=\"@aggregator-sources\">their source</a> (usually via an RSS feed reader). The most recent content in a feed or category can be displayed as a block through the <a href=\"@admin-block\">Blocks administration page</a>.','','none'),(2797,'','default','Adding, editing, and deleting feeds','','none'),(2798,'','default','Administrators can add, edit, and delete feeds, and choose how often to check each feed for newly updated items on the <a href=\"@feededit\">Feed aggregator administration page</a>.','','none'),(2799,'','default','OPML integration','','none'),(2800,'','default','A <a href=\"@aggregator-opml\">machine-readable OPML file</a> of all feeds is available. OPML is an XML-based file format used to share outline-structured information such as a list of RSS feeds. Feeds can also be <a href=\"@import-opml\">imported via an OPML file</a>.','','none'),(2801,'','default','Configuring cron','','none'),(2802,'','default','A correctly configured <a href=\"@cron\">cron maintenance task</a> is required to update feeds automatically.','','none'),(2803,'','default','<acronym title=\"Outline Processor Markup Language\">OPML</acronym> is an XML format used to exchange multiple feeds between aggregators. A single OPML document may contain a collection of many feeds. Drupal can parse such a file and import all feeds at once, saving you the effort of adding them manually. You may either upload a local file from your computer or enter a URL where Drupal can download it.','','none'),(2804,'','default','Administer news feeds','','none'),(2805,'','default','View news feeds','','none'),(2806,'','default','Configure the behavior of the feed aggregator, including when to discard feed items and how to present feed items and categories.','','none'),(2807,'','default','Override the default title for the block. Use <em>!placeholder</em> to display no title, or leave blank to use the default block title.','','7.23'),(2808,'','default','Specify in which themes and regions this block is displayed.','','7.23'),(2809,'','default','All pages except those listed','','7.23'),(2810,'','default','Only the listed pages','','7.23'),(2811,'','default','Specify pages by using their paths. Enter one path per line. The \'*\' character is a wildcard. Example paths are %blog for the blog page and %blog-wildcard for every personal blog. %front is the front page.','','7.23'),(2812,'','default','Pages on which this PHP code returns <code>TRUE</code> (experts only)','','none'),(2813,'','default','Pages or PHP code','','none'),(2814,'','default','If the PHP option is chosen, enter PHP code between %php. Note that executing incorrect PHP code can break your Drupal site.','','none'),(2815,'','default','Customizable per user','','7.23'),(2816,'; modules/block/block.js','default','Not customizable','','7.23'),(2817,'','default','Customizable, visible by default','','7.23'),(2818,'','default','Customizable, hidden by default','','7.23'),(2819,'','default','Ensure that each block description is unique.','','none'),(2820,'','default','The Block module allows you to create boxes of content, which are rendered into an area, or region, of one or more pages of a website. The core Seven administration theme, for example, implements the regions \"Content\", \"Help\", \"Dashboard main\", and \"Dashboard sidebar\", and a block may appear in any one of these regions. The <a href=\"@blocks\">Blocks administration page</a> provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions. For more information, see the online handbook entry for <a href=\"@block\">Block module</a>.','','7.23'),(2821,'','default','Positioning content','','7.23'),(2822,'','default','When working with blocks, remember that all themes do <em>not</em> implement the same regions, or display regions in the same way. Blocks are positioned on a per-theme basis. Users with the <em>Administer blocks</em> permission can disable blocks. Disabled blocks are listed on the <a href=\"@blocks\">Blocks administration page</a>, but are not displayed in any region.','','7.23'),(2823,'','default','Controlling visibility','','7.23'),(2824,'','default','Blocks can be configured to be visible only on certain pages, only to users of certain roles, or only on pages displaying certain <a href=\"@content-type\">content types</a>. Administrators can also allow specific blocks to be enabled or disabled by users when they edit their <a href=\"@user\">My account</a> page. Some dynamic blocks, such as those generated by modules, will be displayed only on certain pages.','','7.23'),(2825,'','default','Creating custom blocks','','7.23'),(2826,'','default','Users with the <em>Administer blocks</em> permission can <a href=\"@block-add\">add custom blocks</a>, which are then listed on the <a href=\"@blocks\">Blocks administration page</a>. Once created, custom blocks behave just like default and module-generated blocks.','','7.23'),(2827,'','default','This page provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions. Since not all themes implement the same regions, or display regions in the same way, blocks are positioned on a per-theme basis. Remember that your changes will not be saved until you click the <em>Save blocks</em> button at the bottom of the page. Click the <em>configure</em> link next to each block to configure its specific title and visibility settings.','','none'),(2828,'','default','Demonstrate block regions (@theme)','','none'),(2829,'','default','Administer blocks','','7.23'),(2830,'','default','A brief description of your block. Used on the <a href=\"@overview\">Blocks administration page</a>.','','none'),(2831,'','default','Personalize blocks','','none'),(2832,'','default','Blocks consist of content or information that complements the main content of the page. Enable or disable optional blocks using the checkboxes below.','','none'),(2833,'','default','Cache blocks','','none'),(2834,'','default','Block caching is inactive because you have enabled modules defining content access restrictions.','','none'),(2835,'','default','Controls the visual building blocks a page is constructed with. Blocks are boxes of content rendered into an area, or region, of a web page.','','7.23'),(2836,'; modules/block/block.js','default','Restricted to certain pages','','none'),(2837,'; modules/block/block.js','default','The block cannot be placed in this region.','','none'),(2838,'','default','Use for multi-user blogs. Every user gets a personal blog.','','none'),(2839,'','default','Single-user blogs','','none'),(2840,'','default','Each user\'s blog entries are automatically displayed with a link to the user\'s main blog page. You can create as many single-user blogs as you have site users with permission to create blog content.','','none'),(2841,'','default','Multi-user blogs','','none'),(2842,'','default','Blog entries from each single-user blog are also aggregated into one central multi-user blog, which displays the blog content of all users in a single listing.','','none'),(2843,'','default','There is an optional <em>Blogs</em> menu item added to the Navigation menu, which displays all blogs available on your site, and a <em>My blog</em> item displaying the current user\'s blog entries.','','none'),(2844,'','default','The Blog module also creates a default <em>Recent blog posts</em> block that may be enabled at the <a href=\"@blocks\">blocks administration page</a>.','','none'),(2845,'','default','Create new blog entry','','none'),(2846,'','default','Enables multi-user blogs.','','7.23'),(2847,'','default','No books available.','','none'),(2848,'','default','Content types allowed in book outlines','','none'),(2849,'','default','Users with the %outline-perm permission can add all content types.','','none'),(2850,'','default','Administer book outlines','','none'),(2851,'','default','The Book module is used for creating structured, multi-page content, such as site resource guides, manuals, and wikis. It allows you to create content that has chapters, sections, subsections, or any similarly-tiered structure. For more information, see the online handbook entry for <a href=\"@book\">Book module</a>.','','none'),(2852,'','default','Adding and managing book content','','none'),(2853,'','default','You can assign separate permissions for <em>creating</em>, <em>editing</em>, and <em>deleting</em> book content, as well as <em>adding content to books</em>, and <em>creating new books</em>. Users with the <em>Administer book outlines</em> permission can add <em>any</em> type of content to a book by selecting the appropriate book outline while editing the content. They can also view a list of all books, and edit and rearrange section titles on the <a href=\"@admin-book\">Book administration page</a>.','','none'),(2854,'','default','Book pages have a default book-specific navigation block. This navigation block contains links that lead to the previous and next pages in the book, and to the level above the current page in the book\'s structure. This block can be enabled on the <a href=\'@admin-block\'>Blocks administration page</a>. For book pages to show up in the book navigation, they must be added to a book outline.','','none'),(2855,'','default','Books can be created collaboratively, as they allow users with appropriate permissions to add pages into existing books, and add those pages to a custom table of contents menu.','','none'),(2856,'','default','Printing books','','none'),(2857,'','default','Users with the <em>View printer-friendly books</em> permission can select the <em>printer-friendly version</em> link visible at the bottom of a book page\'s content to generate a printer-friendly display of the page and all of its subsections.','','none'),(2858,'','default','The book module offers a means to organize a collection of related content pages, collectively known as a book. When viewed, this content automatically displays links to adjacent book pages, providing a simple navigation system for creating and reviewing structured content.','','none'),(2859,'','default','The outline feature allows you to include pages in the <a href=\"@book\">Book hierarchy</a>, as well as move them within the hierarchy or to <a href=\"@book-admin\">reorder an entire book</a>.','','none'),(2860,'','default','Create new books','','none'),(2861,'','default','Add content and child pages to books','','none'),(2862,'','default','View printer-friendly books','','none'),(2863,'','default','View a book page and all of its sub-pages as a single document for ease of printing. Can be performance heavy.','','none'),(2864,'','default','<em>Books</em> have a built-in hierarchical navigation. Use for handbooks or tutorials.','','none'),(2865,'','default','Allows users to create and organize related content in an outline.','','7.23'),(2866,'','default','The Color module allows users with the <em>Administer site configuration</em> permission to quickly and easily change the color scheme of themes that have been built to be compatible with it. For more information, see the online handbook entry for <a href=\"@color\">Color module</a>.','','7.23'),(2867,'','default','Changing colors','','7.23'),(2868,'','default','Using the Color module allows you to easily change the color of links, backgrounds, text, and other theme elements. To change the color settings for a compatible theme, select the <em>Settings</em> link for your theme on the <a href=\'@configure\'>Themes administration page</a>. If you don\'t see a color picker on that page, then your theme is not compatible with the color module. If you are sure that the theme does indeed support the color module, but the color picker does not appear, then <a href=\'@troubleshoot\'>follow these troubleshooting procedures</a>.','','7.23'),(2869,'','default','The Color module saves a modified copy of the theme\'s specified stylesheets in the files directory. This means that if you make any manual changes to your theme\'s stylesheet, <em>you must save your color settings again, even if they haven\'t changed</em>. This step is required because the module stylesheets (in the files directory) need to be recreated to include your changes.','','7.23'),(2870,'','default','The GD library for PHP is enabled, but was compiled without PNG support. Check the <a href=\"@url\">PHP image documentation</a> for information on how to correct this.','','none'),(2871,'','default','The GD library for PHP is missing or outdated. Check the <a href=\"@url\">PHP image documentation</a> for information on how to correct this.','','none'),(2872,'','default','Allows administrators to change the color scheme of compatible themes.','','7.23'),(2873,'','default','Select one or more comments to perform the update on.','','none'),(2874,'','default','There do not appear to be any comments to delete, or your selected comment was deleted by another administrator.','','none'),(2875,'','default','Deleted @count comments.','','none'),(2876,'','default','Deleted comment @cid and its replies.','','none'),(2877,'','default','Comment approved.','','none'),(2878,'','default','Tokens for comments posted on the site.','','7.23'),(2879,'','default','The Comment module allows users to comment on site content, set commenting defaults and permissions, and moderate comments. For more information, see the online handbook entry for <a href=\"@comment\">Comment module</a>.','','7.23'),(2880,'','default','Default and custom settings','','7.23'),(2881,'','default','Each <a href=\'@content-type\'>content type</a> can have its own default comment settings configured as: <em>Open</em> to allow new comments, <em>Hidden</em> to hide existing comments and prevent new comments, or <em>Closed</em> to view existing comments, but prevent new comments. These defaults will apply to all new content created (changes to the settings on existing content must be done manually). Other comment settings can also be customized per content type, and can be overridden for any given item of content. When a comment has no replies, it remains editable by its author, as long as the author has a user account and is logged in.','','7.23'),(2882,'','default','Full comment','','7.23'),(2883,'','default','Unapproved comments (@count)','','7.23'),(2884,'','default','Administer comments and comment settings','','7.23'),(2885,'','default','Edit own comments','','7.23'),(2886,'','default','Number of recent comments','','none'),(2887,'','default','Threading','','none'),(2888,'','default','Show comment replies in a threaded list.','','none'),(2889,'','default','Default comment setting for new content','','none'),(2890,'','default','Allow comment title','','none'),(2891,'','default','Show reply form on the same page as comments','','none'),(2892,'','default','Users with the \"Post comments\" permission can post comments.','','none'),(2893,'','default','Users cannot post comments, but existing comments will be displayed.','','none'),(2894,'','default','Comments are hidden from view.','','none'),(2895,'','default','Users cannot post comments.','','none'),(2896,'','default','Your comment has been queued for review by site administrators and will be published after approval.','','none'),(2897,'','default','Your comment has been posted.','','none'),(2898,'','default','<a href=\"@login\">Log in</a> or <a href=\"@register\">register</a> to post comments','','none'),(2899,'','default','<a href=\"@login\">Log in</a> to post comments','','none'),(2900,'','default','Flat list','','none'),(2901,'','default','Threaded list','','none'),(2902,'','default','Save comment','','7.23'),(2903,'','default','The comment will be unpublished if it contains any of the phrases above. Use a case-sensitive, comma-separated list of phrases. Example: funny, bungee jumping, \"Company, Inc.\"','','none'),(2904,'','default','Published comment %subject.','','none'),(2905,'','default','Saved comment %title','','none'),(2906,'','default','List and edit site comments and the comment approval queue.','','7.23'),(2907,'','default','Unapproved comments','','none'),(2908,'','default','Example: \'webmaster@example.com\' or \'sales@example.com,support@example.com\' . To specify multiple recipients, separate each e-mail address with a comma.','','none'),(2909,'','default','Category %category has been saved.','','none'),(2910,'','default','You cannot send more than %limit messages in @interval. Try again later.','','none'),(2911,'','default','Contact @username','','none'),(2912,'','default','%sender-name (@sender-from) sent an e-mail regarding %category.','','none'),(2913,'','default','%sender-name (@sender-from) sent %recipient-name an e-mail.','','none'),(2914,'','default','The Contact module allows visitors to contact site administrators and other users. Users specify a subject, write their message, and can have a copy of their message sent to their own e-mail address. For more information, see the online handbook entry for <a href=\"@contact\">Contact module</a>.','','none'),(2915,'','default','User contact forms','','none'),(2916,'','default','Site users can be contacted with a user contact form that keeps their e-mail address private. Users may enable or disable their personal contact forms by editing their <em>My account</em> page. If enabled, a <em>Contact</em> tab leads to a personal contact form displayed on their user profile. Site administrators are still able to use the contact form, even if has been disabled. The <em>Contact</em> tab is not shown when you view your own profile.','','none'),(2917,'','default','Site-wide contact forms','','none'),(2918,'','default','The <a href=\"@contact\">Contact page</a> provides a simple form for users with the <em>Use the site-wide contact form</em> permission to send comments, feedback, or other requests. You can create categories for directing the contact form messages to a set of defined recipients. Common categories for a business site, for example, might include \"Website feedback\" (messages are forwarded to website administrators) and \"Product information\" (messages are forwarded to members of the sales department). E-mail addresses defined within a category are not displayed publicly.','','none'),(2919,'','default','When the site-wide contact form is enabled, a link in the main <em>Navigation</em> menu is created, but the link is disabled by default. This menu link can be enabled on the <a href=\'@menu\'>Menus administration page</a>.','','none'),(2920,'','default','Customization','','none'),(2921,'','default','If you would like additional text to appear on the site-wide or personal contact page, use a block. You can create and edit blocks on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(2922,'','default','Add one or more categories on this page to set up your site-wide <a href=\"@form\">contact form</a>.','','none'),(2923,'','default','A <em>Contact</em> menu item (disabled by default) is added to the Navigation menu, which you can modify on the <a href=\"@menu-settings\">Menus administration page</a>.','','none'),(2924,'','default','If you would like additional text to appear on the site-wide contact page, use a block. You can create and edit blocks on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(2925,'','default','Administer contact forms and contact form settings','','none'),(2926,'','default','Use the site-wide contact form','','none'),(2927,'','default','Use users\' personal contact forms','','none'),(2928,'','default','!sender-name (!sender-url) sent a message using the contact form at !form-url.','','none'),(2929,'','default','[!site-name] !subject','','none'),(2930,'','default','!sender-name (!sender-url) has sent you a message via your contact form (!form-url) at !site-name.','','none'),(2931,'','default','If you don\'t want to receive such e-mails, you can change your settings at !recipient-edit-url.','','none'),(2932,'','default','Allow other users to contact you via a <a href=\"@url\">personal contact form</a> which keeps your e-mail address hidden. Note that some privileged users such as site administrators are still able to contact you even if you choose to disable this feature.','','none'),(2933,'','default','Enable the personal contact form by default for new users.','','none'),(2934,'','default','Changing this setting will not affect existing users.','','none'),(2935,'','default','The Contextual links module displays links related to regions of pages on your site to users with <em>access contextual links</em> permission. For more information, see the online handbook entry for <a href=\"@contextual\">Contextual links module</a>.','','7.23'),(2936,'','default','Displaying contextual links','','7.23'),(2937,'','default','Contextual links are supplied by modules, to give you quick access to tasks associated with regions of pages on your site. For instance, if you have a custom menu block displayed in a sidebar of your site, the Blocks and Menus modules will supply links to configure the block and edit the menu. The Contextual links module collects these links into a list for display by your theme, and also adds JavaScript code to the page to hide the links initially, and display them when your mouse hovers over the block.','','7.23'),(2938,'','default','Use contextual links','','7.23'),(2939,'','default','Use contextual links to perform actions related to elements on a page.','','7.23'),(2940,'','default','Contextual links','','none'),(2941,'','default','Provides contextual links to perform actions related to elements on a page.','','7.23'),(2942,'','default','Tracking user activity','','7.23'),(2943,'','default','By enabling blocks such as <em>Who\'s online</em> and <em>Who\'s new</em>, site users can track who is logged in and new user signups at a centralized location.','','7.23'),(2944,'','default','Tracking content activity','','7.23'),(2945,'','default','By enabling blocks such as <em>Recent blog posts</em>, <em>New forum topics</em> and <em>Recent comments</em>, site users can view newly added site content at a glance.','','7.23'),(2946,'','default','View the administrative dashboard','','7.23'),(2947,'','default','This dashboard region is empty. Click <em>Customize dashboard</em> to add blocks to it.','','none'),(2948,'','default','DRAG HERE','','none'),(2949,'','default','Provides a dashboard page in the administrative interface for organizing administrative tasks and tracking information within your site.','','7.23'),(2950,'; modules/dashboard/dashboard.js','default','Customize dashboard','','7.23'),(2951,'','default','Clear log messages','','none'),(2952,'','default','This will permanently remove the log messages from the database.','','none'),(2953,'','default','Database log cleared.','','none'),(2954,'','default','The Database logging module logs system events in the Drupal database. For more information, see the online handbook entry for the <a href=\"@dblog\">Database logging module</a>.','','7.23'),(2955,'','default','Monitoring your site','','7.23'),(2956,'','default','Debugging site problems','','7.23'),(2957,'','default','Field validation errors','','none'),(2958,'','default','Attempt to create a field with a name longer than 32 characters: %name','','none'),(2959,'','default','Attempt to create field name %name which already exists and is active.','','none'),(2960,'','default','Attempt to create field name %name which already exists, although it is inactive.','','none'),(2961,'','default','Attempt to create field name %name which is reserved by entity type %type.','','none'),(2962,'','default','Attempt to create a field of unknown type %type.','','none'),(2963,'','default','Attempt to create a field with unknown storage type %type.','','none'),(2964,'','default','Attempt to create an instance of field @field_name without a bundle.','','none'),(2965,'','default','Enabling field types','','7.23'),(2966,'','default','The Field module provides the infrastructure for fields and field attachment; the field types and input widgets themselves are provided by additional modules. Some of the modules are required; the optional modules can be enabled from the <a href=\"@modules\">Modules administration page</a>. Drupal core includes the following field type modules: Number (required), Text (required), List (required), Taxonomy (optional), Image (optional), and File (optional); the required Options module provides input widgets for other field modules. Additional fields and widgets may be provided by contributed modules, which you can find in the <a href=\"@contrib\">contributed module section of Drupal.org</a>. Currently enabled field and input widget modules:','','7.23'),(2967,'','default','Managing field data storage','','7.23'),(2968,'','default','Developers of field modules can either use the default <a href=\"@sql-store\">Field SQL storage module</a> to store data for their fields, or a contributed or custom module developed using the <a href=\"@storage-api\">field storage API</a>.','','7.23'),(2969,'','default','The Field SQL storage module stores field data in the database. It is the default field storage module; other field storage mechanisms may be available as contributed modules. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.23'),(2970,'','default','Default SQL storage','','7.23'),(2971,'','default','Stores fields in the local SQL database, using per-field tables.','','7.23'),(2972,'','default','Field SQL storage','','none'),(2973,'','default','Stores field data in an SQL database.','','7.23'),(2974,'','default','The List module defines various fields for storing a list of items, for use with the Field module. Usually these items are entered through a select list, checkboxes, or radio buttons. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.23'),(2975,'','default','This field stores simple on/off or yes/no options.','','7.23'),(2976,'','default','List (text)','','7.23'),(2977,'','default','The \'checkboxes/radio buttons\' widget will display checkboxes if the <em>Number of values</em> option is greater than 1 for this field, otherwise radios will be displayed.','','none'),(2978,'','default','Allowed HTML tags in labels: @tags','','none'),(2979,'','default','The value of this field is being determined by the %function function and may not be changed.','','none'),(2980,'','default','Allowed values list: each key must be a valid integer or decimal.','','none'),(2981,'','default','Allowed values list: each key must be a string at most 255 characters long.','','none'),(2982,'','default','Allowed values list: keys must be integers.','','none'),(2983,'','default','Defines list field types. Use with Options to create selection lists.','','7.23'),(2984,'','default','The Number module defines various numeric field types for the Field module. Numbers can be in integer, decimal, or floating-point form, and they can be formatted when displayed. Number fields can be limited to a specific set of input values or to a range of values. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.23'),(2985,'','default','This field stores a number in the database as an integer.','','7.23'),(2986,'','default','This field stores a number in the database in a fixed decimal format.','','7.23'),(2987,'','default','This field stores a number in the database in a floating point format.','','7.23'),(2988,'','default','The minimum value that should be allowed in this field. Leave blank for no minimum.','','none'),(2989,'','default','The maximum value that should be allowed in this field. Leave blank for no maximum.','','none'),(2990,'','default','Define a string that should be prefixed to the value, like \'$ \' or \'&euro; \'. Leave blank for none. Separate singular and plural values with a pipe (\'pound|pounds\').','','none'),(2991,'','default','Only numbers and the decimal separator (@separator) allowed in %field.','','none'),(2992,'','default','The Options module defines checkbox, selection, and other input widgets for the Field module. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.23'),(2993,'','default','The Text module defines various text field types for the Field module. A text field may contain plain text only, or optionally, may use Drupal\'s <a href=\'@filter-help\'>text filters</a> to securely manage HTML output. Text input fields may be either a single line (text field), multiple lines (text area), or for greater input control, a select box, checkbox, or radio buttons. If desired, the field can be validated, so that it is limited to a set of allowed values. See the <a href=\'@field-help\'>Field module help page</a> for more information about fields.','','7.23'),(2994,'','default','This field stores varchar text in the database.','','7.23'),(2995,'','default','Long text','','7.23'),(2996,'','default','This field stores long text in the database.','','7.23'),(2997,'','default','Long text and summary','','7.23'),(2998,'','default','This field stores long text in the database along with optional summary text.','','7.23'),(2999,'','default','Filtered text (user selects text format)','','none'),(3000,'','default','Summary input','','none'),(3001,'','default','This allows authors to input an explicit summary, to be displayed instead of the automatically trimmed text when using the \"Summary or trimmed\" display type.','','none'),(3002,'','default','%name: the text may not be longer than %max characters.','','none'),(3003,'','default','%name: the summary may not be longer than %max characters.','','none'),(3004,'','default','Summary or trimmed','','7.23'),(3005,'','default','Text area with a summary','','7.23'),(3006,'','default','Leave blank to use trimmed value of full text as the summary.','','none'),(3007,'; modules/field/modules/text/text.js','default','Hide summary','','none'),(3008,'; modules/field/modules/text/text.js','default','Edit summary','','none'),(3009,'','default','%field (@field_name) field requires the %widget_type widget provided by %widget_module module','','none'),(3010,'','default','Inactive fields are not shown unless their providing modules are enabled. The following fields are not enabled: !list','','none'),(3011,'','default','Edit field settings.','','none'),(3012,'','default','Change widget type.','','none'),(3013,'','default','Edit instance settings.','','none'),(3014,'','default','Delete instance.','','none'),(3015,'','default','The field %label cannot be added because it is locked.','','none'),(3016,'','default','There was a problem creating field instance %label: @message.','','none'),(3017,'','default','There are no fields yet added. You can add new fields on the <a href=\"@link\">Manage fields</a> page.','','none'),(3018,'','default','These settings apply to the %field field everywhere it is used. These settings impact the way that data is stored in the database and cannot be changed once data has been created.','','none'),(3019,'','default','%field has no field settings.','','none'),(3020,'','default','Updated field %label field settings.','','none'),(3021,'','default','Attempt to update field %label failed: %message.','','none'),(3022,'','default','Change widget','','none'),(3023,'','default','The type of form element you would like to present to the user when creating this field in the %type type.','','none'),(3024,'','default','Changed the widget for field %label.','','none'),(3025,'','default','There was a problem changing the widget for field %label.','','none'),(3026,'','default','This field is <strong>locked</strong> and cannot be deleted.','','none'),(3027,'','default','The field %field has been deleted from the %type content type.','','none'),(3028,'','default','There was a problem removing the %field from the %type content type.','','none'),(3029,'','default','These settings apply only to the %field field when used in the %type type.','','none'),(3030,'','default','Required field','','none'),(3031,'','default','These settings apply to the %field field everywhere it is used. Because the field already has data, some settings can no longer be changed.','','none'),(3032,'','default','These settings apply to the %field field everywhere it is used.','','none'),(3033,'','default','%field field settings','','none'),(3034,'','default','The default value for this field, used when creating new content.','','none'),(3035,'','default','Saved %label configuration.','','none'),(3036,'','default','This list shows all fields currently in use for easy reference.','','none'),(3037,'','default','Save and add fields','','none'),(3038,'','default','Field list','','7.23'),(3039,'','default','Manage display','','7.23'),(3040,'','default','Field UI','','none'),(3041,'','default','This field stores the ID of a file as an integer value.','','7.23'),(3042,'','default','Enable <em>Display</em> field','','none'),(3043,'','default','The display option allows users to choose if a file should be shown when viewing the content.','','none'),(3044,'','default','Files displayed by default','','none'),(3045,'','default','This setting only has an effect if the display option is enabled.','','none'),(3046,'','default','Upload destination','','none'),(3047,'','default','Select where the final files should be stored. Private file storage has significantly more overhead than public files, but allows restricted access to files within this field.','','none'),(3048,'','default','Optional subdirectory within the upload destination where files will be stored. Do not include preceding or trailing slashes.','','none'),(3049,'','default','Enter a value like \"512\" (bytes), \"80 KB\" (kilobytes) or \"50 MB\" (megabytes) in order to restrict the allowed file size. If left empty the file sizes will be limited only by PHP\'s maximum post and file upload sizes (current limit <strong>%limit</strong>).','','none'),(3050,'','default','Enable <em>Description</em> field','','none'),(3051,'','default','The description field allows users to enter a description about the uploaded file.','','none'),(3052,'','default','The \"!name\" option must contain a valid value. You may either leave the text field empty or enter a string like \"512\" (bytes), \"80 KB\" (kilobytes) or \"50 MB\" (megabytes).','','none'),(3053,'','default','The list of allowed extensions is not valid, be sure to exclude leading dots and to separate extensions with a comma or space.','','none'),(3054,'','default','Generic file','','7.23'),(3055,'','default','Table of files','','7.23'),(3056,'','default','Add a new file','','none'),(3057,'','default','Include file in display','','none'),(3058,'','default','The description may be used as the label of the link to the file.','','none'),(3059,'','default','Files must be less than !size.','','7.23'),(3060,'','default','Allowed file types: !extensions.','','7.23'),(3061,'','default','Images must be exactly !size pixels.','','none'),(3062,'','default','Images must be between !min and !max pixels.','','none'),(3063,'','default','Images must be larger than !min pixels.','','none'),(3064,'','default','Images must be smaller than !max pixels.','','none'),(3065,'','default','The File module defines a <em>File</em> field type for the Field module, which lets you manage and validate uploaded files attached to content on your site (see the <a href=\"@field-help\">Field module help page</a> for more information about fields). For more information, see the online handbook entry for <a href=\"@file\">File module</a>.','','7.23'),(3066,'','default','Attaching files to content','','7.23'),(3067,'','default','The File module allows users to attach files to content (e.g., PDF files, spreadsheets, etc.), when a <em>File</em> field is added to a given content type using the <a href=\"@fieldui-help\">Field UI module</a>. You can add validation options to your File field, such as specifying a maximum file size and allowed file extensions.','','7.23'),(3068,'','default','Managing attachment display','','7.23'),(3069,'','default','When you attach a file to content, you can specify whether it is <em>listed</em> or not. Listed files are displayed automatically in a section at the bottom of your content; non-listed files are available for embedding in your content, but are not included in the list at the bottom.','','7.23'),(3070,'','default','Managing file locations','','7.23'),(3071,'','default','When you create a File field, you can specify a directory where the files will be stored, which can be within either the <em>public</em> or <em>private</em> files directory. Files in the public directory can be accessed directly through the web server; when public files are listed, direct links to the files are used, and anyone who knows a file\'s URL can download the file. Files in the private directory are not accessible directly through the web server; when private files are listed, the links are Drupal path requests. This adds to server load and download time, since Drupal must start up and resolve the path for each file download request, but allows for access restrictions.','','7.23'),(3072,'','default','An unrecoverable error occurred. Use of this form has expired. Try reloading the page and submitting again.','','none'),(3073,'','default','The file referenced by the !name field does not exist.','','none'),(3074,'','default','The file in the !name field was unable to be uploaded.','','none'),(3075,'','default','The upload directory %directory for the file field !name could not be created or is not accessible. A newly uploaded file could not be saved in this directory as a consequence, and the upload was canceled.','','none'),(3076,'','default','Your server is not capable of displaying file upload progress. File upload progress requires an Apache server running PHP with mod_php.','','none'),(3077,'','default','All roles may use this format','','none'),(3078,'','default','The text format ordering has been saved.','','none'),(3079,'','default','Add text format','','7.23'),(3080,'','default','All roles for this text format must be enabled and cannot be changed.','','none'),(3081,'','default','Filter processing order','','none'),(3082,'','default','Text format names must be unique. A format named %name already exists.','','none'),(3083,'','default','Added text format %format.','','none'),(3084,'','default','The text format %format has been updated.','','none'),(3085,'','default','Text formats','','7.23'),(3086,'','default','The Filter module allows administrators to configure text formats. A text format defines the HTML tags, codes, and other input allowed in content and comments, and is a key feature in guarding against potentially damaging input from malicious users. For more information, see the online handbook entry for <a href=\"@filter\">Filter module</a>.','','7.23'),(3087,'','default','Applying filters to text','','7.23'),(3088,'','default','Each text format uses filters to manipulate text, and most formats apply several different filters to text in a specific order. Each filter is designed for a specific purpose, and generally either adds, removes, or transforms elements within user-entered text before it is displayed. A filter does not change the actual content, but instead, modifies it temporarily before it is displayed. One filter may remove unapproved HTML tags, while another automatically adds HTML to make URLs display as clickable links.','','7.23'),(3089,'','default','Defining text formats','','7.23'),(3090,'','default','One format is included by default: <em>Plain text</em> (which removes all HTML tags). Additional formats may be created by your installation profile when you install Drupal, and more can be created by an administrator on the <a href=\"@text-formats\">Text formats page</a>.','','7.23'),(3091,'','default','Choosing a text format','','7.23'),(3092,'','default','A text format contains filters that change the user input, for example stripping out malicious HTML or making URLs clickable. Filters are executed from top to bottom and the order is important, since one filter may prevent another filter from doing its job. For example, when URLs are converted into links before disallowed HTML tags are removed, all links may be removed. When this happens, the order of filters may need to be re-arranged.','','none'),(3093,'','default','Warning: This permission may have security implications depending on how the text format is configured.','','7.23'),(3094,'','default','Use the !text_format text format','','7.23'),(3095,'','default','More information about text formats','','none'),(3096,'','default','Limit allowed HTML tags','','7.23'),(3097,'','default','Convert line breaks into HTML (i.e. <code>&lt;br&gt;</code> and <code>&lt;p&gt;</code>)','','7.23'),(3098,'','default','Convert URLs into links','','7.23'),(3099,'','default','Correct faulty and chopped off HTML','','7.23'),(3100,'','default','Display any HTML as plain text','','7.23'),(3101,'','default','A list of HTML tags that can be used. JavaScript event attributes, JavaScript URLs, and CSS are always stripped.','','none'),(3102,'','default','Display basic HTML help in long filter tips','','none'),(3103,'','default','Add rel=\"nofollow\" to all links','','none'),(3104,'','default','This site allows HTML content. While learning all of HTML may feel intimidating, learning how to use a very small number of the most basic HTML \"tags\" is very easy. This table provides examples for each tag that is enabled on this site.','','7.23'),(3105,'','default','For more information see W3C\'s <a href=\"@html-specifications\">HTML Specifications</a> or use your favorite search engine to find other sites that explain HTML.','','7.23'),(3106,'','default','Most unusual characters can be directly entered without any problems.','','7.23'),(3107,'','default','If you do encounter problems, try using HTML character entities. A common example looks like &amp;amp; for an ampersand &amp; character. For a full list of entities see HTML\'s <a href=\"@html-entities\">entities</a> page. Some of the available characters include:','','7.23'),(3108,'','default','No HTML tags allowed.','','7.23'),(3109,'','default','Filters content in preparation for display.','','7.23'),(3110,'','default','By !author @time ago','','none'),(3111,'','default','The forum %term and all sub-forums have been deleted.','','none'),(3112,'','default','The number of replies a topic must have to be considered \"hot\".','','none'),(3113,'','default','No containers or forums available. <a href=\"@container\">Add container</a> or <a href=\"@forum\">Add forum</a>.','','none'),(3114,'','default','forum: deleted %term and all its sub-forums.','','none'),(3115,'','default','The Forum module lets you create threaded discussion forums with functionality similar to other message board systems. Forums are useful because they allow community members to discuss topics with one another while ensuring those conversations are archived for later reference. In a forum, users post topics and threads in nested hierarchies, allowing discussions to be categorized and grouped. The forum hierarchy consists of:','','none'),(3116,'','default','Optional containers (for example, <em>Support</em>), which can hold:','','none'),(3117,'','default','Forums (for example, <em>Installing Drupal</em>), which can hold:','','none'),(3118,'','default','Forum topics submitted by users (for example, <em>How to start a Drupal 6 Multisite</em>), which start discussions and are starting points for:','','none'),(3119,'','default','Threaded comments submitted by users (for example, <em>You have these options...</em>).','','none'),(3120,'','default','Setting up forum structure','','none'),(3121,'','default','Visit the <a href=\"@forums\">Forums page</a> to set up containers and forums to hold your discussion topics.','','none'),(3122,'','default','Starting a discussion','','none'),(3123,'','default','The <a href=\"@create-topic\">Forum topic</a> link on the <a href=\"@content-add\">Add new content</a> page creates the first post of a new threaded discussion, or thread.','','none'),(3124,'','default','Enabling the Forum module provides a default <em>Forums</em> menu item in the navigation menu that links to the <a href=\"@forums\">Forums page</a>.','','none'),(3125,'','default','Moving forum topics','','none'),(3126,'','default','A forum topic (and all of its comments) may be moved between forums by selecting a different forum while editing a forum topic. When moving a forum topic between forums, the <em>Leave shadow copy</em> option creates a link in the original forum pointing to the new location.','','none'),(3127,'','default','Locking and disabling comments','','none'),(3128,'','default','Selecting <em>Closed</em> under <em>Comment settings</em> whi