books</a>. The handbooks contain more extensive and up-to-date information, are annotated with user-contributed comments, and serve as the definitive reference point for all Drupal documentation. For more information, see the online handbook entry for the <a href=\"@help\">Help module</a>.','','7.23'),(3144,'','default','Providing a help reference','','7.23'),(3145,'','default','The Help module displays explanations for using each module listed on the main <a href=\"@help\">Help reference page</a>.','','7.23'),(3146,'','default','Providing context-sensitive help','','7.23'),(3147,'','default','The Help module displays context-sensitive advice and explanations on various pages.','','7.23'),(3148,'','default','Edit %name style','','none'),(3149,'','default','This image style is currently being provided by a module. Click the \"Override defaults\" button to change its settings.','','none'),(3150,'','default','Image style name','','none'),(3151,'','default','The name is used in URLs for generated images. Use only lowercase alphanumeric characters, underscores (_), and hyphens (-).','','none'),(3152,'','default','Select a new effect','','none'),(3153,'','default','Override defaults','','none'),(3154,'','default','Update style','','none'),(3155,'','default','Select an effect to add.','','none'),(3156,'','default','The image effect was successfully applied.','','none'),(3157,'','default','The %style style has been overridden, allowing you to change its settings.','','none'),(3158,'','default','Style name','','none'),(3159,'','default','Create new style','','none'),(3160,'','default','Style %name was created.','','none'),(3161,'','default','The image style name %name is already in use.','','none'),(3162,'','default','Please only use lowercase alphanumeric characters, underscores (_), and hyphens (-) for style names.','','none'),(3163,'','default','No replacement, just delete','','none'),(3164,'','default','Replacement style','','none'),(3165,'','default','Optionally select 