ill maintain the aspect-ratio of the original image. If only a single dimension is specified, the other dimension will be calculated.','','7.23'),(3189,'','default','Scale and crop','','7.23'),(3190,'','default','Scale and crop will maintain the aspect-ratio of the original image, then crop the larger dimension. This is most useful for creating perfectly square thumbnails without stretching the image.','','7.23'),(3191,'','default','Cropping will remove portions of an image to make it the specified dimensions.','','7.23'),(3192,'','default','Desaturate','','7.23'),(3193,'','default','Desaturate converts an image to grayscale.','','7.23'),(3194,'','default','Rotating an image may cause the dimensions of an image to increase to fit the diagonal.','','7.23'),(3195,'','default','Image resize failed using the %toolkit toolkit on %path (%mimetype, %dimensions)','','none'),(3196,'','default','Image scale failed using the %toolkit toolkit on %path (%mimetype, %dimensions)','','none'),(3197,'','default','Image crop failed using the %toolkit toolkit on %path (%mimetype, %dimensions)','','none'),(3198,'','default','Image scale and crop failed using the %toolkit toolkit on %path (%mimetype, %dimensions)','','none'),(3199,'','default','Image desaturate failed using the %toolkit toolkit on %path (%mimetype, %dimensions)','','none'),(3200,'','default','Image rotate failed using the %toolkit toolkit on %path (%mimetype, %dimensions)','','none'),(3201,'','default','This field stores the ID of an image file as an integer value.','','7.23'),(3202,'','default','If no image is uploaded, this image will be shown on display.','','none'),(3203,'','default','The maximum allowed image size expressed as WIDTHxHEIGHT (e.g. 640x480). Leave blank for no restriction. If a larger image is uploaded, it will be resized to reflect the given width and height. Resizing images on upload will cause the loss of <a href=\"http://en.wikipedia.org/wiki/Exchangeable_image_file_format\">EXIF data</a> in the image.','','none'),(3204,'','default','Minimum image resolution','','none'),(3205,'','default','The minimum allowed image size expressed as WIDTHxHEIGHT (e.g. 640x480). Leave blank for no restriction. If a smaller image is uploaded, it will be rejected.','','none'),(3206,'','default','Enable <em>Alt</em> field','','none'),(3207,'','default','The alt attribute may be used by search engines, screen readers, and when the image cannot be loaded.','','none'),(3208,'','default','Enable <em>Title</em> field','','none'),(3209,'','default','The title attribute is used as a tooltip when the mouse hovers over the image.','','none'),(3210,'','default','Height and width values must be numeric.','','none'),(3211,'','default','Both a height and width value must be specified in the !name field.','','none'),(3212,'','default','Preview image style','','none'),(3213,'','default','no preview','','none'),(3214,'','default','The preview image will be shown while editing the content.','','none'),(3215,'','default','The Image module allows you to manipulate images on your website. It exposes a setting for using the <em>Image toolkit</em>, allows you to configure <em>Image styles</em> that can be used for resizing or adjusting images on display, and provides an <em>Image</em> field for attaching images to content. For more information, see the online handbook entry for <a href=\"@image\">Image module</a>.','','7.23'),(3216,'','default','Manipulating images','','7.23'),(3217,'','default','With the Image module you can scale, crop, resize, rotate and desaturate images without affecting the original image using <a href=\"@image\">image styles</a>. When you change an image style, the module automatically refreshes all created images. Every image style must have a name, which will be used in the URL of the generated images. There are two common approaches to naming image styles (which you use will depend on how the image style is being applied):','','7.23'),(3218,'','default','Based on where it will be used: eg. <em>profile-picture</em>','','7.23'),(3219,'','default','Describing its appearance: eg. <em>square-85x85</em>','','7.23'),(3220,'','default','Attaching images to content as fields','','7.23'),(3221,'','default','Image module also allows you to attach images to content as fields. To add an image field to a <a href=\'@content-type\'>content type</a>, go to the content type\'s <em>manage fields</em> page, and add a new field of type <em>Image</em>. Attaching images to content this way allows image styles to be applied and maintained, and also allows you more flexibility when theming.','','7.23'),(3222,'','default','Image styles commonly provide thumbnail sizes by scaling and cropping images, but can also add various effects before an image is displayed. When an image is displayed with a style, a new file is created and the original image is left unchanged.','','none'),(3223,'','default','Administer image styles','','7.23'),(3224,'','default','Create and modify styles for generating image modifications such as thumbnails.','','7.23'),(3225,'','default','No defined styles','','none'),(3226,'','default','Image generation in progress. Try again shortly.','','none'),(3227,'','default','Error generating image.','','7.23'),(3228,'','default','Unable to generate the derived image located at %path.','','none'),(3229,'','default','Failed to create style directory: %directory','','none'),(3230,'','default','Cached image file %destination already exists. There may be an issue with your rewrite configuration.','','none'),(3231,'','default','Generate image style','','7.23'),(3232,'','default','Image styles','','7.23'),(3233,'','default','Configure styles that can be used for resizing or adjusting images on display.','','7.23'),(3234,'','default','List the current image styles on the site.','','7.23'),(3235,'','default','Add style','','7.23'),(3236,'','default','Add a new image style.','','7.23'),(3237,'','default','Configure an image style.','','7.23'),(3238,'','default','Delete an image style.','','none'),(3239,'','default','Revert style','','none'),(3240,'','default','Revert an image style.','','none'),(3241,'','default','Edit image effect','','none'),(3242,'','default','Delete image effect','','none'),(3243,'','default','Add image effect','','none'),(3244,'','default','Add a new effect to a style.','','none'),(3245,'','default','Provides image manipulation tools.','','7.23'),(3246,'','default','Use the <em>Custom language</em> section below if your desired language does not appear in this list.','','none'),(3247,'','default','Path prefix language code','','none'),(3248,'','default','Language code or other custom text to use as a path prefix for URL language detection, if your <em>Detection and selection</em> settings use URL path prefixes. For the default language, this value may be left blank. <strong>Modifying this value may break existing URLs. Use with caution in a production environment.</strong> Example: Specifying \"deutsch\" as the path prefix code for German results in URLs like \"example.com/deutsch/contact\".','','none'),(3249,'','default','Detection method','','none'),(3250,'','default','Part of the URL that determines language','','none'),(3251,'','default','<em>Path prefix</em>: URLs like http://example.com/de/contact set language to German (de). <em>Domain</em>: URLs like http://de.example.com/contact set the language to German. <strong>Warning: Changing this setting may break incoming URLs. Use with caution on a production site.</strong>','','none'),(3252,'','default','Request/session parameter','','none'),(3253,'','default','Name of the request/session parameter used to determine the desired language.','','none'),(3254,'','default','Filter translatable strings','','none'),(3255,'','default','Date type','','none'),(3256,'','default','Are you sure you want to reset the date formats for %language to the global defaults?','','none'),(3257,'','default','Resetting will remove all localized date formats for this language. This action cannot be undone.','','none'),(3258,'','default','The Locale module allows your Drupal site to be presented in languages other than the default English, and to be multilingual. The Locale module works by maintaining a database of translations, and examining text as it is about to be displayed. When a translation of the text is available in the language to be displayed, the translation is displayed rather than the original text. When a translation is unavailable, the original text is displayed, and then stored for review by a translator. For more information, see the online handbook entry for <a href=\"@locale\">Locale module</a>.','','7.23'),(3259,'','default','Translating interface text','','7.23'),(3260,'','default','Translations of text in the Drupal interface may be provided by:','','7.23'),(3261,'','default','Translating within your site, using the Locale module\'s integrated <a href=\'@translate\'>translation interface</a>.','','7.23'),(3262,'','default','Importing files from a set of existing translations, known as a translation package. A translation package enables the display of a specific version of Drupal in a specific language, and contains files in the Gettext Portable Object (<em>.po</em>) format. Although not all languages are available for every version of Drupal, translation packages for many languages are available for download from the <a href=\"@translations\">Drupal translations page</a>.','','7.23'),(3263,'','default','If an existing translation package does not meet your needs, the Gettext Portable Object (<em>.po</em>) files within a package may be modified, or new <em>.po</em> files may be created, using a desktop Gettext editor. The Locale module\'s <a href=\'@import\'>import</a> feature allows the translated strings from a new or modified <em>.po</em> file to be added to your site. The Locale module\'s <a href=\'@export\'>export</a> feature generates files from your site\'s translated strings, that can either be shared with others or edited offline by a Gettext translation editor.','','7.23'),(3264,'','default','Configuring a multilingual site','','7.23'),(3265,'','default','Language negotiation allows your site to automatically change language based on the domain or path used for each request. Users may (optionally) select their preferred language on their <em>My account</em> page, and your site can be configured to honor a web browser\'s preferred language settings. Site content can be translated using the <a href=\'@content-help\'>Content translation module</a>.','','7.23'),(3266,'','default','With multiple languages enabled, interface text can be translated, registered users may select their preferred language, and authors can assign a specific language to content. <a href=\"@translations\">Download contributed translations</a> from Drupal.org.','','7.23'),(3267,'','default','Add a language to be supported by your site. If your desired language is not available in the <em>Language name</em> drop-down, click <em>Custom language</em> and provide a language code and other details manually. When providing a language code manually, be sure to enter a standardized language code, since this code may be used by browsers to determine an appropriate display language.','','none'),(3268,'','default','Determine the language from a request/session parameter. Example: \"http://example.com?language=de\" sets language to German based on the use of \"de\" within the \"language\" parameter.','','none'),(3269,'','default','See the <a href=\"@languages\">Languages page</a> for more information on adding support for additional languages.','','none'),(3270,'','default','This page imports the translated strings contained in an individual Gettext Portable Object (<em>.po</em>) file. Normally distributed as part of a translation package (each translation package may contain several <em>.po</em> files), a <em>.po</em> file may need to be imported after offline editing in a Gettext translation editor. Importing an individual <em>.po</em> file may be a lengthy process.','','none'),(3271,'','default','This page allows a translator to search for specific translated and untranslated strings, and is used when creating or editing translations. (Note: For translation tasks involving many strings, it may be more convenient to <a href=\"@export\">export</a> strings for offline editing in a desktop Gettext translation editor.) Searches may be limited to strings found within a specific text group or in a specific language.','','none'),(3272,'','default','Administer languages','','7.23'),(3273,'','default','Translate interface texts','','7.23'),(3274,'','default','Order of language detection methods for content. If a version of content is available in the detected language, it will be displayed.','','7.23'),(3275,'','default','Order of language detection methods for user interface text. If a translation of user interface text is available in the detected language, it will be displayed.','','7.23'),(3276,'','default','Determine the language from the URL (Path prefix or domain).','','7.23'),(3277,'','default','Determine the language from a request/session parameter.','','7.23'),(3278,'','default','Follow the user\'s language preference.','','7.23'),(3279,'','default','Determine the language from the browser\'s language settings.','','7.23'),(3280,'','default','Language switcher (@type)','','7.23'),(3281,'','default','Detection and selection','','7.23'),(3282,'','default','URL language detection configuration','','7.23'),(3283,'','default','Session language detection configuration','','7.23'),(3284,'','default','Localize','','7.23'),(3285,'','default','Localize date formats','','none'),(3286,'','default','Reset date formats','','none'),(3287,'','default','Reset localized date formats to global defaults','','none'),(3288,'','default','January','Long month name','none'),(3289,'','default','February','Long month name','none'),(3290,'','default','March','Long month name','none'),(3291,'','default','April','Long month name','none'),(3292,'','default','May','Long month name','none'),(3293,'','default','June','Long month name','none'),(3294,'','default','July','Long month name','none'),(3295,'','default','August','Long month name','none'),(3296,'','default','September','Long month name','none'),(3297,'','default','October','Long month name','7.23'),(3298,'','default','November','Long month name','7.23'),(3299,'','default','December','Long month name','7.23'),(3300,'','default','add link','','none'),(3301,'','default','There are no menu links yet. <a href=\"@link\">Add link</a>.','','none'),(3302,'','default','The text to be used for this link in the menu.','','none'),(3303,'','default','The path for this menu link. This can be an internal Drupal path such as %add-node or an external URL such as %drupal. Enter %front to link to the front page.','','none'),(3304,'','default','Menu links that are not enabled will not be listed in any menu.','','none'),(3305,'','default','Show as expanded','','none'),(3306,'','default','If selected and this menu link has children, the menu will always appear expanded.','','none'),(3307,'','default','Parent link','','none'),(3308,'','default','The maximum depth for a link and all its children is fixed at !maxdepth. Some menu links may not be available as parents if selecting them would exceed this limit.','','none'),(3309,'','default','Optional. In the menu, the heavier links will sink and the lighter links will be positioned nearer the top.','','none'),(3310,'','default','Are you sure you want to delete the custom menu link %item?','','none'),(3311,'','default','The menu link %title has been deleted.','','none'),(3312,'','default','Are you sure you want to reset the link %item to its default values?','','none'),(3313,'','default','The menu link was reset to its default settings.','','none'),(3314,'','default','No Main links','','none'),(3315,'','default','Source for the Main links','','none'),(3316,'','default','Select what should be displayed as the Main links (typically at the top of the page).','','none'),(3317,'','default','No Secondary links','','none'),(3318,'','default','Source for the Secondary links','','none'),(3319,'','default','Select the source for the Secondary links. An advanced option allows you to use the same source for both Main links (currently %main) and Secondary links: if your source menu has two levels of hierarchy, the top level menu links will appear in the Main links, and the children of the active link will appear in the Secondary links.','','none'),(3320,'','default','Deleted custom menu %title and all its menu links.','','none'),(3321,'','default','Deleted menu link %title.','','none'),(3322,'','default','<strong>Warning:</strong> There is currently 1 menu link in %title. It will be deleted (system-defined items will be reset).','','none'),(3323,'','default','<strong>Warning:</strong> There are currently @count menu links in %title. They will be deleted (system-defined links will be reset).','','none'),(3324,'','default','Managing menus','','7.23'),(3325,'','default','Users with the <em>Administer menus and menu items</em> permission can add, edit and delete custom menus on the <a href=\"@menu\">Menus administration page</a>. Custom menus can be special site menus, menus of external links, or any combination of internal and external links. You may create an unlimited number of additional menus, each of which will automatically have an associated block. By selecting <em>list links</em>, you can add, edit, or delete links for a given menu. The links listing page provides a drag-and-drop interface for controlling the order of links, and creating a hierarchy within the menu.','','7.23'),(3326,'','default','Displaying menus','','7.23'),(3327,'','default','After you have created a menu, you must enable and position the associated block on the <a href=\"@blocks\">Blocks administration page</a>.','','7.23'),(3328,'','default','You can enable the newly-created block for this menu on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(3329,'','default','Each menu has a corresponding block that is managed on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(3330,'','default','Administer menus and menu items','','7.23'),(3331,'','default','Provide a menu link','','none'),(3332,'','default','Menu links with smaller weights are displayed before links with larger weights.','','none'),(3333,'','default','Available menus','','none'),(3334,'','default','The menus available to place links in for this content type.','','none'),(3335,'','default','Default parent item','','none'),(3336,'','default','Choose the menu item to be the default parent for a new link in the content authoring form.','','none'),(3337,'','default','Add new menus to your site, edit existing menus, and rename and reorganize menu links.','','7.23'),(3338,'','default','Parent menu items','','7.23'),(3339,'','default','Edit menu link','','7.23'),(3340,'','default','Reset menu link','','none'),(3341,'','default','Delete menu link','','7.23'),(3342,'','default','The <em>Navigation</em> menu contains links intended for site visitors. Links are added to the <em>Navigation</em> menu automatically by some modules.','','none'),(3343,'','default','The <em>User</em> menu contains links related to the user\'s account, as well as the \'Log out\' link.','','none'),(3344,'','default','The <em>Management</em> menu contains links for administrative tasks.','','none'),(3345,'','default','The <em>Main</em> menu is used on many sites to show the major sections of the site, often in a top navigation bar.','','none'),(3346,'','default','manage display','','none'),(3347,'','default','No content types available. <a href=\"@link\">Add content type</a>.','','none'),(3348,'','default','The human-readable name of this content type. This text will be displayed as part of the list on the <em>Add new content</em> page. It is recommended that this name begin with a capital letter and contain only letters, numbers, and spaces. This name must be unique.','','none'),(3349,'','default','Describe this content type. The text will be displayed on the <em>Add new content</em> page.','','none'),(3350,'','default','Preview before submitting','','none'),(3351,'','default','This text will be displayed at the top of the page when creating or editing content of this type.','','none'),(3352,'','default','Users with the <em>Administer content</em> permission will be able to override these options.','','none'),(3353,'','default','Display author and date information.','','none'),(3354,'','default','Author username and publish date will be displayed.','','none'),(3355,'','default','Invalid machine-readable name. Enter a name other than %invalid.','','none'),(3356,'','default','%type is used by 1 piece of content on your site. If you remove this content type, you will not be able to edit the %type content and it may not display correctly.','','none'),(3357,'','default','%type is used by @count pieces of content on your site. If you remove %type, you will not be able to edit the %type content and it may not display correctly.','','none'),(3358,'','default','Publish selected content','','none'),(3359,'','default','Unpublish selected content','','none'),(3360,'','default','Promote selected content to front page','','none'),(3361,'','default','Demote selected content from front page','','none'),(3362,'','default','Make selected content sticky','','none'),(3363,'','default','Make selected content not sticky','','none'),(3364,'','default','Delete selected content','','none'),(3365,'','default','Deleted @count posts.','','none'),(3366,'','default','Are you sure you want to delete this item?','','none'),(3367,'','default','Are you sure you want to delete these items?','','none'),(3368,'','default','<em>Edit @type</em> @title','','none'),(3369,'','default','You have not created any content types yet. Go to the <a href=\"@create-content\">content type creation page</a> to add a new content type.','','none'),(3370,'','default','Revision log message','','7.23'),(3371,'','default','Provide an explanation of the changes you are making. This will help other authors understand your motivations.','','none'),(3372,'','default','Tokens related to individual content items, or \"nodes\".','','7.23'),(3373,'','default','The unique ID of the content item, or \"node\".','','7.23'),(3374,'','default','The main body text of the node.','','7.23'),(3375,'','default','The summary of the node\'s main body text.','','7.23'),(3376,'','default','The content access permissions need to be rebuilt. <a href=\"@node_access_rebuild\">Rebuild permissions</a>.','','none'),(3377,'','default','The Node module manages the creation, editing, deletion, settings, and display of the main site content. Content items managed by the Node module are typically displayed as pages on your site, and include a title, some meta-data (author, creation time, content type, etc.), and optional fields containing text or other data (fields are managed by the <a href=\"@field\">Field module</a>). For more information, see the online handbook entry for <a href=\"@node\">Node module</a>.','','7.23'),(3378,'','default','Creating content','','7.23'),(3379,'','default','When new content is created, the Node module records basic information about the content, including the author, date of creation, and the <a href=\"@content-type\">Content type</a>. It also manages the <em>publishing options</em>, which define whether or not the content is published, promoted to the front page of the site, and/or sticky at the top of content lists. Default settings can be configured for each <a href=\"@content-type\">type of content</a> on your site.','','7.23'),(3380,'','default','Creating custom content types','','7.23'),(3381,'','default','The Node module gives users with the <em>Administer content types</em> permission the ability to <a href=\"@content-new\">create new content types</a> in addition to the default ones already configured. Creating custom content types allows you the flexibility to add <a href=\"@field\">fields</a> and configure default settings that suit the differing needs of various site content.','','7.23'),(3382,'','default','Administering content','','7.23'),(3383,'','default','The <a href=\"@content\">Content administration page</a> allows you to review and bulk manage your site content.','','7.23'),(3384,'','default','Creating revisions','','7.23'),(3385,'','default','The Node module also enables you to create multiple versions of any content, and revert to older versions using the <em>Revision information</em> settings.','','7.23'),(3386,'','default','User permissions','','7.23'),(3387,'','default','The Node module makes a number of permissions available for each content type, which can be set by role on the <a href=\"@permissions\">permissions page</a>.','','7.23'),(3388,'','default','Individual content types can have different fields, behaviors, and permissions assigned to them.','','none'),(3389,'','default','Content items can be displayed using different view modes: Teaser, Full content, Print, RSS, etc. <em>Teaser</em> is a short format that is typically used in lists of multiple content items. <em>Full content</em> is typically used when the content is displayed on its own page.','','none'),(3390,'','default','Here, you can define which fields are shown and hidden when %type content is displayed in each view mode, and define how the fields are displayed in each view mode.','','none'),(3391,'','default','Revisions allow you to track differences between multiple versions of your content, and revert back to older versions.','','none'),(3392,'','default','Full content','','7.23'),(3393,'','default','Search result','','7.23'),(3394,'','default','The content on this page has either been modified by another user, or you have already submitted modifications using this form. As a result, your changes cannot be saved.','','none'),(3395,'','default','Administer content types','','7.23'),(3396,'','default','Warning: Give to trusted roles only; this permission has security implications.','','none'),(3397,'','default','View published content','','7.23'),(3398,'','default','Access the content overview page','','7.23'),(3399,'','default','Bypass content access control','','7.23'),(3400,'','default','View content revisions','','7.23'),(3401,'','default','Revert content revisions','','7.23'),(3402,'','default','Delete content revisions','','7.23'),(3403,'','default','View own unpublished content','','7.23'),(3404,'','default','Content is sticky at top of lists','','7.23'),(3405,'','default','Content is promoted to the front page','','7.23'),(3406,'','default','Recent content','','7.23'),(3407,'','default','Number of recent content items to display','','none'),(3408,'','default','Show block for specific content types','','7.23'),(3409,'','default','Show this block only on pages that display content of the given type(s). If you select no types, there will be no type-specific limitation.','','7.23'),(3410,'','default','Welcome to @site-name','','7.23'),(3411,'','default','No front page content has been created yet.','','7.23'),(3412,'','default','Unpublish content','','7.23'),(3413,'','default','Make content sticky','','7.23'),(3414,'','default','Make content unsticky','','7.23'),(3415,'','default','Promote content to front page','','7.23'),(3416,'','default','Remove content from front page','','7.23'),(3417,'','default','Change the author of content','','7.23'),(3418,'','default','Save content','','7.23'),(3419,'','default','Unpublish content containing keyword(s)','','7.23'),(3420,'','default','The content will be unpublished if it contains any of the phrases above. Use a case-sensitive, comma-separated list of phrases. Example: funny, bungee jumping, \"Company, Inc.\"','','none'),(3421,'','default','If the site is experiencing problems with permissions to content, you may have to rebuild the permissions cache. Rebuilding will remove all privileges to content and replace them with permissions based on the current modules and settings. Rebuilding may take some time if there is a lot of content or complex permission settings. After rebuilding has completed, content will automatically use the new permissions.','','none'),(3422,'','default','Node Access Permissions','','none'),(3423,'','default','One permission in use','','none'),(3424,'','default','@count permissions in use','','none'),(3425,'','default','Find and manage content.','','none'),(3426,'','default','Manage content types, including default status, front page promotion, comment settings, etc.','','7.23'),(3427,'','default','Edit content type','','none'),(3428,'; modules/node/content_types.js','default','Don\'t display post information','','none'),(3429,'','default','This site supports <a href=\"@openid-net\">OpenID</a>, a secure way to log in to many websites using a single username and password. OpenID can reduce the necessity of managing many usernames and passwords for many websites.','','none'),(3430,'','default','If you already have an OpenID, enter the URL to your OpenID server below (e.g. myusername.openidprovider.com). Next time you log in, you will be able to use this URL instead of a regular username and password. You can have multiple OpenID servers if you like; just keep adding them here.','','none'),(3431,'','default','The OpenID module allows users to log in using the OpenID single sign on service. <a href=\"@openid-net\">OpenID</a> is a secure method for logging into many websites with a single username and password. It does not require special software, and it does not share passwords with any site to which it is associated, including the site being logged into. The main benefit to users is that they can have a single password that they can use on many websites. This means they can easily update their single password from a centralized location, rather than having to change dozens of passwords individually. For more information, see the online handbook entry for <a href=\"@handbook\">OpenID module</a>.','','none'),(3432,'','default','Logging in with OpenID','','none'),(3433,'','default','To log in using OpenID, a user must already have an OpenID account. Users can then create site accounts using their OpenID, assign one or more OpenIDs to an existing account, and log in using an OpenID. This lowers the barrier to registration, which helps increase the user base, and offers convenience and security to the users. Because OpenID cannot guarantee a user is legitimate, email verification is still necessary. When logging in, users are presented with the option of entering their OpenID URL, which will look like <em>myusername.openidprovider.com</em>. The site then communicates with the OpenID server, asking it to verify the identity of the user. If the user is logged into their OpenID server, the server communicates back to your site, verifying the user. If they are not logged in, the OpenID server will ask the user for their password. At no point does the site being logged into record the user\'s OpenID password.','','none'),(3434,'','default','Once you have verified your e-mail address, you may log in via OpenID.','','none'),(3435,'','default','Sorry, that is not a valid OpenID. Ensure you have spelled your ID correctly.','','none'),(3436,'','default','Complete the registration by filling out the form below. If you already have an account, you can <a href=\"@login\">log in</a> now and add your OpenID under \"My account\".','','none'),(3437,'','default','Account registration using the information provided by your OpenID provider failed due to the reasons listed below. Complete the registration by filling out the form below. If you already have an account, you can <a href=\"@login\">log in</a> now and add your OpenID under \"My account\".','','none'),(3438,'','default','The Overlay module makes the administration pages on your site display in a JavaScript overlay of the page you were viewing when you clicked the administrative link, instead of replacing the page in your browser window. Use the close link on the overlay to return to the page you were viewing when you clicked the link. For more information, see the online handbook entry for <a href=\"@overlay\">Overlay module</a>.','','7.23'),(3439,'','default','Access the administrative overlay','','7.23'),(3440,'','default','View administrative pages in the overlay.','','7.23'),(3441,'','default','Displays the Drupal administration interface in an overlay.','','7.23'),(3442,'','default','Specify the existing path you wish to alias. For example: node/28, forum/1, taxonomy/term/1.','','none'),(3443,'','default','The Path module allows you to specify an alias, or custom URL, for any existing internal system path. Aliases should not be confused with URL redirects, which allow you to forward a changed or inactive URL to a new URL. In addition to making URLs more readable, aliases also help search engines index content more effectively. Multiple aliases may be used for a single internal system path. To automate the aliasing of paths, you can install the contributed module <a href=\"@pathauto\">Pathauto</a>. For more information, see the online handbook entry for the <a href=\"@path\">Path module</a>.','','7.23'),(3444,'','default','Creating aliases','','7.23'),(3445,'','default','Users with sufficient <a href=\"@permissions\">permissions</a> can create aliases under the <em>URL path settings</em> section when they create or edit content. Some examples of aliases are: ','','7.23'),(3446,'','default','<em>member/jane-smith</em> aliased to internal path <em>user/123</em>','','7.23'),(3447,'','default','<em>about-us/team</em> aliased to internal path <em>node/456</em>','','7.23'),(3448,'','default','Managing aliases','','7.23'),(3449,'','default','The Path module provides a way to search and view a <a href=\"@aliases\">list of all aliases</a> that are in use on your website. Aliases can be added, edited and deleted through this list.','','7.23'),(3450,'','default','An alias defines a different name for an existing URL path - for example, the alias \'about\' for the URL path \'node/1\'. A URL path can have multiple aliases.','','none'),(3451,'','default','Administer URL aliases','','7.23'),(3452,'','default','Create and edit URL aliases','','7.23'),(3453,'','default','The alias is already in use.','','none'),(3454,'','default','Optionally specify an alternative URL by which this term can be accessed. Use a relative path and don\'t add a trailing slash or the URL alias won\'t work.','','none'),(3455,'','default','Enabling execution of PHP in text fields','','none'),(3456,'','default','The PHP filter module allows users with the proper permissions to include custom PHP code that will get executed when pages of your site are processed. While this is a powerful and flexible feature if used by a trusted user with PHP experience, it is a significant and dangerous security risk in the hands of a malicious or inexperienced user. Even a trusted user may accidentally compromise the site by entering malformed or incorrect PHP code. Only the most trusted users should be granted permission to use the PHP filter, and all PHP code added through the PHP filter should be carefully examined before use. <a href=\"@php-snippets\">Example PHP snippets</a> can be found on Drupal.org.','','none'),(3457,'','default','Use PHP for settings','','none'),(3458,'','default','<p>Add a custom block to your site, named \"Welcome\" . With its text format set to \"PHP code\" (or another format supporting PHP input), add the following in the Block body:</p>\n<pre>\nprint t(\'Welcome visitor! Thank you for visiting.\');\n</pre>','','none'),(3459,'','default','<p>To display the name of a registered user, use this instead:</p>\n<pre>\nglobal $user;\nif ($user->uid) {\n  print t(\'Welcome @name! Thank you for visiting.\', array(\'@name\' => format_username($user)));\n}\nelse {\n  print t(\'Welcome visitor! Thank you for visiting.\');\n}\n</pre>','','none'),(3460,'','default','The PHP module has been disabled. Any existing content that was using the PHP filter will now be visible in plain text. This might pose a security risk by exposing sensitive information, if any, used in the PHP code.','','none'),(3461,'','default','The Poll module can be used to create simple surveys or questionnaires that display cumulative results. A poll is a good way to receive feedback from site users and community members. For more information, see the online handbook entry for the <a href=\"@poll\">Poll module</a>.','','none'),(3462,'','default','Creating a poll','','none'),(3463,'','default','Users can create a poll by clicking on Poll on the <a href=\"@add-content\">Add new content</a> page, and entering the question being posed, the answer choices, and beginning vote counts for each choice. The status (closed or active) and duration (length of time the poll remains active for new votes) can also be specified.','','none'),(3464,'','default','Viewing polls','','none'),(3465,'','default','You can visit the <a href=\"@poll\">Polls</a> page to view all current polls, or alternately enable the <em>Most recent poll</em> block on the <a href=\"@blocks\">Blocks administration page</a>. To vote in or view the results of a specific poll, you can click on the poll itself.','','none'),(3466,'','default','Vote on polls','','none'),(3467,'','default','Cancel and change own votes','','none'),(3468,'','default','Your vote was cancelled.','','none'),(3469,'','default','To enable browsing this field by value, enter a title for the resulting page. The word <code>%value</code> will be substituted with the corresponding value. An example page title is \"People whose favorite color is %value\" . This is only applicable for a public field.','','none'),(3470,'','default','To enable browsing this field by value, enter a title for the resulting page. An example page title is \"People who are employed\" . This is only applicable for a public field.','','none'),(3471,'','default','The Profile module allows site administrators to define custom fields (such as country, full name, or age) for user profiles, which are then displayed in the <a href=\"@user\">My Account</a> section. This permits users of a site to share more information about themselves, and can help community-based sites organize users around specific information. For more information, see the online handbook entry for <a href=\"@profile\">Profile module</a>.','','none'),(3472,'','default','Adding fields to the default profile','','none'),(3473,'','default','To provide the ability for users to enter more information about themselves, the Profile module allows additional fields to be added to the default user profile. Examples of common additions would be <em>Location</em>, <em>Company</em>, <em>Age</em>, or <em>About me</em>.','','none'),(3474,'','default','User information pages','','none'),(3475,'','default','The Profile module enables links to see further information about site users. You can view both a main <a href=\"@profile\">User list page</a>, and more specified pages by clicking on linked fields in any profile. For example, the <a href=\"@profile-country\">People who live in Canada</a> listing on Drupal.org displays all users who have entered <em>Canada</em> in the <em>Country</em> field on their user profile.','','none'),(3476,'','default','Author information block','','none'),(3477,'','default','The <em>Author information block</em> is a default block created by the Profile module that can be enabled on the <a href=\"@blocks\">Blocks administration page</a>. It shows visitors of your website information about the author of the page they are reading.','','none'),(3478,'','default','This page displays a list of the existing custom profile fields to be displayed on a user\'s <em>My account</em> page. To provide structure, similar or related fields may be placed inside a category. To add a new category (or edit an existing one), edit a profile field and provide a new category name.','','none'),(3479,'','default','Enriches your content with metadata to let other applications (e.g. search engines, aggregators) better understand its relationships and attributes.','','7.23'),(3480,'','default','The active search modules have been changed.','','none'),(3481,'','default','You must include at least one positive keyword with 1 character or more.','','none'),(3482,'','default','You must include at least one positive keyword with @count characters or more.','','7.23'),(3483,'','default','Searched %type for %keys.','','none'),(3484,'','default','The Search module provides the ability to index and search for content by exact keywords, and for users by username or e-mail. For more information, see the online handbook entry for <a href=\"@search-module\">Search module</a>.','','7.23'),(3485,'','default','Searching content and users','','7.23'),(3486,'','default','Users with <em>Use search</em> permission can use the search block and <a href=\"@search\">Search page</a>. Users with the <em>View published content</em> permission can search for content containing exact keywords. Users with the <em>View user profiles</em> permission can search for users containing the keyword anywhere in the user name, and users with the <em>Administer users</em> permission can search for users by email address. Additionally, users with <em>Use advanced search</em> permission can find content using more complex search methods and filtering by choosing the <em>Advanced search</em> option on the <a href=\"@search\">Search page</a>.','','7.23'),(3487,'','default','Indexing content with cron','','7.23'),(3488,'','default','Configuring search settings','','7.23'),(3489,'','default','Indexing behavior can be adjusted using the <a href=\"@searchsettings\">Search settings page</a>. Users with <em>Administer search</em> permission can control settings such as the <em>Number of items to index per cron run</em>, <em>Indexing settings</em> (word length), <em>Active search modules</em>, and <em>Content ranking</em>, which lets you adjust the priority in which indexed content is returned in results.','','7.23'),(3490,'','default','The Search module includes a default <em>Search form</em> block, which can be enabled and configured on the <a href=\"@blocks\">Blocks administration page</a>. The block is available to users with the <em>Search content</em> permission.','','7.23'),(3491,'','default','Extending Search module','','7.23'),(3492,'','default','By default, the Search module only supports exact keyword matching in content searches. You can modify this behavior by installing a language-specific stemming module for your language (such as <a href=\"http://drupal.org/project/porterstemmer\">Porter Stemmer</a> for American English), which allows words such as walk, walking, and walked to be matched in the Search module. Another approach is to use a third-party search technology with stemming or partial word matching features built in, such as <a href=\"http://drupal.org/project/apachesolr\">Apache Solr</a> or <a href=\"http://drupal.org/project/sphinx\">Sphinx</a>. These and other <a href=\"@contrib-search\">search-related contributed modules</a> can be downloaded by visiting Drupal.org.','','7.23'),(3493,'','default','<ul>\n<li>Check if your spelling is correct.</li>\n<li>Remove quotes around phrases to search for each word individually. <em>bike shed</em> will often show more results than <em>&quot;bike shed&quot;</em>.</li>\n<li>Consider loosening your query with <em>OR</em>. <em>bike OR shed</em> will often show more results than <em>bike shed</em>.</li>\n</ul>','','7.23'),(3494,'','default','Administer search','','7.23'),(3495,'','default','Use search','','7.23'),(3496,'','default','Use advanced search','','7.23'),(3497,'','default','Configure relevance settings for search and other indexing options.','','7.23'),(3498,'','default','Choose a set of shortcuts to use','','none'),(3499,'','default','Choose a set of shortcuts for this user','','none'),(3500,'','default','You are now using the new %set_name shortcut set. You can edit it from this page or <a href=\"@switch-url\">switch back to a different one.</a>','','none'),(3501,'','default','%user is now using a new shortcut set called %set_name. You can edit it from this page.','','none'),(3502,'','default','You are now using the %set_name shortcut set.','','none'),(3503,'','default','%user is now using the %set_name shortcut set.','','none'),(3504,'','default','Change set','','none'),(3505,'','default','The shortcut set has been updated.','','none'),(3506,'','default','Add new shortcut','','none'),(3507,'','default','Editing @shortcut','','none'),(3508,'','default','The name of the shortcut.','','none'),(3509,'','default','The path to the shortcut.','','none'),(3510,'','default','The link must correspond to a valid path on the site.','','none'),(3511,'','default','The shortcut %link has been updated.','','none'),(3512,'','default','Added a shortcut for %title.','','none'),(3513,'','default','Are you sure you want to delete the shortcut %title?','','none'),(3514,'','default','The shortcut %title has been deleted.','','none'),(3515,'','default','Unable to add a shortcut for %title.','','none'),(3516,'','default','Adding and removing shortcuts','','7.23'),(3517,'','default','Displaying shortcuts','','7.23'),(3518,'','default','You can display your shortcuts by enabling the Shortcuts block on the <a href=\"@blocks\">Blocks administration page</a>. Certain administrative modules also display your shortcuts; for example, the core <a href=\"@toolbar-help\">Toolbar module</a> displays them near the top of the page, along with an <em>Edit shortcuts</em> link.','','7.23'),(3519,'','default','Administer shortcuts','','7.23'),(3520,'','default','@shortcut_set shortcuts','','none'),(3521,'','default','Add to %shortcut_set shortcuts','','7.23'),(3522,'','default','Add to shortcuts','','none'),(3523,'','default','Remove from %shortcut_set shortcuts','','7.23'),(3524,'','default','Remove from shortcuts','','none'),(3525,'','default','Edit shortcuts','','7.23'),(3526,'','default','Add shortcut','','none'),(3527,'','default','Edit shortcut','','none'),(3528,'','default','Delete shortcut','','none'),(3529,'','default','Allows users to manage customizable lists of shortcut links.','','7.23'),(3530,'','default','Value @value is TRUE.','','none'),(3531,'','default','Value @value is FALSE.','','none'),(3532,'','default','Value @value is NULL.','','none'),(3533,'','default','Value @value is not NULL.','','none'),(3534,'','default','Value @first is equal to value @second.','','none'),(3535,'','default','Value @first is not equal to value @second.','','none'),(3536,'','default','Value @first is identical to value @second.','','none'),(3537,'','default','Value @first is not identical to value @second.','','none'),(3538,'','default','The test did not complete due to a fatal error.','','none'),(3539,'','default','Link with label %label found.','','none'),(3540,'','default','Link with label %label not found.','','none'),(3541,'','default','Link containing href %href found.','','none'),(3542,'','default','No link containing href %href found.','','none'),(3543,'','default','Clicked link %label (@url_target) from @url_before','','none'),(3544,'','default','Option @option for field @id is selected.','','none'),(3545,'','default','Option @option for field @id is not selected.','','none'),(3546,'','default','By default SimpleTest will clear the results after they have been viewed on the results page, but in some cases it may be useful to leave the results in the database. The results can then be viewed at <em>admin/config/development/testing/[test_id]</em>. The test ID can be found in the database, simpletest table, or kept track of when viewing the results the first time. Additionally, some modules may provide more analysis or features that require this setting to be disabled.','','none'),(3547,'','default','GSS negotiate','','none'),(3548,'','default','NTLM','','none'),(3549,'','default','Any safe','','none'),(3550,'','default','The Testing module provides a framework for running automated unit tests. It can be used to verify a working state of Drupal before and after any code changes, or as a means for developers to write and execute tests for their modules. For more information, see the online handbook entry for <a href=\"@simpletest\">Testing module</a>.','','none'),(3551,'','default','Running tests','','none'),(3552,'','default','Visit the <a href=\"@admin-simpletest\">Testing page</a> to display a list of available tests. For comprehensive testing, select <em>all</em> tests, or individually select tests for more targeted testing. Note that it might take several minutes for all tests to complete. For more information on creating and modifying your own tests, see the <a href=\"@simpletest-api\">Testing API Documentation</a> in the Drupal handbook.','','none'),(3553,'','default','After the tests run, a message will be displayed next to each test group indicating whether tests within it passed, failed, or had exceptions. A pass means that the test returned the expected results, while fail means that it did not. An exception normally indicates an error outside of the test, such as a PHP warning or notice. If there were failures or exceptions, the results will be expanded to show details, and the tests that had failures or exceptions will be indicated in red or pink rows. You can then use these results to refine your code and tests, until all tests pass.','','none'),(3554,'','default','Administer tests','','none'),(3555,'','default','The test run finished in @elapsed.','','none'),(3556,'','default','Use the <em>Clean environment</em> button to clean-up temporary files and tables.','','none'),(3557,'','default','The testing framework requires the PHP <a href=\"@open_basedir-url\">open_basedir</a> restriction to be disabled. Check your webserver configuration or contact your web host.','','none'),(3558,'','default','The testing framework could not be installed because the PHP <a href=\"@curl_url\">cURL</a> library is not available.','','none'),(3559,'','default','The testing framework could not be installed because the PHP <a href=\"@hash_url\">hash</a> extension is disabled.','','none'),(3560,'','default','PHP open_basedir restriction','','none'),(3561,'','default','unblock IP address','','none'),(3562,'','default','block IP address','','none'),(3563,'','default','The Statistics module shows you how often a given page is viewed, who viewed it, the previous page the user visited (referrer URL), and when it was viewed. These statistics are useful in determining how users are visiting and navigating your site. For more information, see the online handbook entry for the <a href=\"@statistics\">Statistics module</a>.','','none'),(3564,'','default','Managing logs','','none'),(3565,'','default','To enable collection of statistics, the <em>Enable access log</em> checkbox on the <a href=\"@statistics-settings\">Statistics settings page</a> must be checked. The <em>Discard access logs older than</em> setting on the settings page specifies the length of time entries are kept in the log before they are deleted. This setting requires a correctly configured <a href=\"@cron\">cron maintenance task</a> to run.','','none'),(3566,'','default','Viewing site usage','','none'),(3567,'','default','The Statistics module can help you break down details about your users and how they are using the site. The module offers four reports:','','none'),(3568,'','default','<a href=\"@recent-hits\">Recent hits</a> displays information about the latest activity on your site, including the URL and title of the page that was accessed, the user name (if available) and the IP address of the viewer.','','none'),(3569,'','default','<a href=\"@top-referrers\">Top referrers</a> displays where visitors came from (referrer URL).','','none'),(3570,'','default','<a href=\"@top-pages\">Top pages</a> displays a list of pages ordered by how often they were viewed.','','none'),(3571,'','default','<a href=\"@top-visitors\">Top visitors</a> shows you the most active visitors for your site and allows you to ban abusive visitors.','','none'),(3572,'','default','Displaying popular content','','none'),(3573,'','default','The module includes a <em>Popular content</em> block that displays the most viewed pages today and for all time, and the last content viewed. To use the block, enable <em>Count content views</em> on the <a href=\"@statistics-settings\">statistics settings page</a>, and then you can enable and configure the block on the <a href=\"@blocks\">blocks administration page</a>.','','none'),(3574,'','default','Page view counter','','none'),(3575,'','default','The Statistics module includes a counter for each page that increases whenever the page is viewed. To use the counter, enable <em>Count content views</em> on the <a href=\"@statistics-settings\">statistics settings page</a>, and set the necessary <a href=\"@permissions\">permissions</a> (<em>View content hits</em>) so that the counter is visible to the users.','','none'),(3576,'','default','Administer statistics','','none'),(3577,'','default','View content access statistics','','none'),(3578,'','default','View content hits','','none'),(3579,'','default','Control details about what and how your site logs access statistics.','','none'),(3580,'','default','The Syslog module logs events by sending messages to the logging facility of your web server\'s operating system. Syslog is an operating system administrative logging tool that provides valuable information for use in system management and security auditing. Most suited to medium and large sites, Syslog provides filtering tools that allow messages to be routed by type and severity. For more information, see the online handbook entry for <a href=\'@syslog\'>Syslog module</a> and PHP\'s <a href=\'@php_openlog\'>openlog</a> and <a href=\'@php_syslog\'>syslog</a> functions.','','none'),(3581,'','default','Logging for UNIX, Linux, and Mac OS X','','none'),(3582,'','default','On UNIX, Linux, and Mac OS X, the file <em>/etc/syslog.conf</em> defines the routing configuration. Messages can be flagged with the codes <code>LOG_LOCAL0</code> through <code>LOG_LOCAL7</code>. For information on Syslog facilities, severity levels, and how to set up <em>syslog.conf</em>, see the <em>syslog.conf</em> manual page on your command line.','','none'),(3583,'','default','Logging for Microsoft Windows','','none'),(3584,'','default','On Microsoft Windows, messages are always sent to the Event Log using the code <code>LOG_USER</code>.','','none'),(3585,'','default','Syslog facility','','none'),(3586,'','default','Depending on the system configuration, Syslog and other logging tools use this code to identify or filter messages from within the entire system log.','','none'),(3587,'','default','The image %file could not be rotated because the imagerotate() function is not available in this PHP installation.','','none'),(3588,'','default','The image %file could not be desaturated because the imagefilter() function is not available in this PHP installation.','','none'),(3589,'','default','Screenshot for !theme theme','','none'),(3590,'','default','Settings for !theme theme','','none'),(3591,'','default','Disable !theme theme','','none'),(3592,'','default','Set !theme as default theme','','none'),(3593,'','default','Enable !theme theme','','none'),(3594,'','default','Enable and set default','','none'),(3595,'','default','Enable !theme as default theme','','none'),(3596,'','default','default theme','','none'),(3597,'','default','Choose \"Default theme\" to always use the same theme as the rest of the site.','','none'),(3598,'','default','Use the administration theme when editing or creating content','','none'),(3599,'','default','The %theme theme has been enable