ge is displayed when the requested document is denied to the current user. Leave blank to display a generic \"access denied\" page.','','none'),(3624,'','default','This page is displayed when no other content matches the requested document. Leave blank to display a generic \"page not found\" page.','','none'),(3625,'','default','Errors and warnings','','none'),(3626,'','default','Clear all caches','','none'),(3627,'','default','<strong class=\"error\">Set up the <a href=\"!file-system\">public files directory</a> to make these optimizations available.</strong>','','none'),(3628,'','default','Bandwidth optimization','','none'),(3629,'','default','Compress cached pages.','','none'),(3630,'','default','Public file system path','','none'),(3631,'','default','A local file system path where public files will be stored. This directory must exist and be writable by Drupal. This directory must be relative to the Drupal installation directory and be accessible over the web.','','none'),(3632,'','default','Private file system path','','none'),(3633,'','default','A local file system path where temporary files will be stored. This directory should not be accessible over the web.','','none'),(3634,'','default','Default download method','','none'),(3635,'','default','This setting is used as the preferred download method. The use of public files is more efficient, but does not provide any access control.','','none'),(3636,'','default','No image toolkits were detected. Drupal includes support for <a href=\'!gd-link\'>PHP\'s built-in image processing functions</a> but they were not detected on this system. You should consult your system administrator to have them enabled, or try using a third party toolkit.','','none'),(3637,'','default','Description of your site, included in each feed.','','none'),(3638,'','default','Time zones','','none'),(3639,'','default','Users may set their own time zone.','','none'),(3640,'','default','Remind users at login if their time zone is not set.','','none'),(3641,'','default','Only applied if users may set their own time zone.','','none'),(3642,'','default','Time zone for new users','','none'),(3643,'','default','Default time zone.','','none'),(3644,'','default','Empty time zone.','','none'),(3645,'','default','Users may set their own time zone at registration.','','none'),(3646,'','default','No date types available. <a href=\"@link\">Add date type</a>.','','none'),(3647,'','default','Add date type','','7.23'),(3648,'','default','The date type must contain only alphanumeric characters and underscores.','','none'),(3649,'','default','This date type already exists. Enter a unique type.','','none'),(3650,'','default','New date type added successfully.','','none'),(3651,'','default','Put site into maintenance mode','','none'),(3652,'','default','Maintenance mode message','','none'),(3653,'','default','Message to show visitors when the site is in maintenance mode.','','none'),(3654,'','default','Use URLs like <code>example.com/user</code> instead of <code>example.com/?q=user</code>.','','none'),(3655,'','default','Requires: !module-list','','7.23'),(3656,'','default','Required by: !module-list','','7.23'),(3657,'','default','Are you sure you want to remove the date type %type?','','none'),(3658,'','default','Removed date type %type.','','none'),(3659,'','default','No custom date formats available. <a href=\"@link\">Add date format</a>.','','none'),(3660,'','default','Displayed as','','none'),(3661,'','default','Displayed as %date','','none'),(3662,'','default','A user-defined date format. See the <a href=\"@url\">PHP manual</a> for available options.','','none'),(3663,'','default','Save format','','none'),(3664,'','default','This format already exists. Enter a unique format string.','','none'),(3665,'','default','Custom date format updated.','','none'),(3666,'','default','Custom date format added.','','none'),(3667,'','default','Available actions:','','none'),(3668,'','default','Create an advanced action','','none'),(3669,'','default','A unique label for this advanced action. This label will be displayed in the interface of modules that integrate with actions, such as Trigger module.','','none'),(3670,'','default','Deleted %ip','','none'),(3671,'','default','Enabled theme','','none'),(3672,'','default','Enabled themes','','none'),(3673,'','default','Disabled theme','','none'),(3674,'','default','You must enable the @required module to install @module.','','none'),(3675,'','default','You must enable the @required modules to install @module.','','none'),(3676,'','default','Tokens for site-wide settings and other global information.','','7.23'),(3677,'','default','Tokens related to times and dates.','','7.23'),(3678,'','default','Tokens related to uploaded files.','','7.23'),(3679,'','default','URL (brief)','','7.23'),(3680,'','default','The URL of the site\'s front page without the protocol.','','7.23'),(3681,'','default','Short format','','7.23'),(3682,'','default','A date in \'short\' format. (%date)','','7.23'),(3683,'','default','Medium format','','7.23'),(3684,'','default','A date in \'medium\' format. (%date)','','7.23'),(3685,'','default','Long format','','7.23'),(3686,'','default','A date in \'long\' format. (%date)','','7.23'),(3687,'','default','A date in a custom format. See !php-date for details.','','7.23'),(3688,'','default','the PHP documentation','','7.23'),(3689,'','default','Time-since','','7.23'),(3690,'','default','Raw timestamp','','7.23'),(3691,'','default','A date in UNIX timestamp format (%date)','','7.23'),(3692,'','default','The System module is integral to the site, and provides basic but extensible functionality for use by other modules and themes. Some integral elements of Drupal are contained in and managed by the System module, including caching, enabling and disabling modules and themes, preparing and displaying the administrative page, and configuring fundamental site settings. A number of key system maintenance operations are also part of the System module. For more information, see the online handbook entry for <a href=\"@system\">System module</a>.','','7.23'),(3693,'','default','Managing modules','','7.23'),(3694,'','default','The System module allows users with the appropriate permissions to enable and disable modules on the <a href=\"@modules\">Modules administration page</a>. Drupal comes with a number of core modules, and each module provides a discrete set of features and may be enabled or disabled depending on the needs of the site. Many additional modules contributed by members of the Drupal community are available for download at the <a href=\"@drupal-modules\">Drupal.org module page</a>.','','7.23'),(3695,'','default','Managing themes','','7.23'),(3696,'','default','The System module allows users with the appropriate permissions to enable and disable themes on the <a href=\"@themes\">Appearance administration page</a>. Themes determine the design and presentation of your site. Drupal comes packaged with several core themes, and additional contributed themes are available at the <a href=\"@drupal-themes\">Drupal.org theme page</a>.','','7.23'),(3697,'','default','Managing caching','','7.23'),(3698,'','default','The System module allows users with the appropriate permissions to manage caching on the <a href=\'@cache-settings\'>Performance settings page</a>. Drupal has a robust caching system that allows the efficient re-use of previously-constructed web pages and web page components. Pages requested by anonymous users are stored in a compressed format; depending on your site configuration and the amount of your web traffic tied to anonymous visitors, the caching system may significantly increase the speed of your site.','','7.23'),(3699,'','default','Performing system maintenance','','7.23'),(3700,'','default','Configuring basic site settings','','7.23'),(3701,'','default','The System module also handles basic configuration options for your site, including <a href=\"@date-time-settings\">Date and time settings</a>, <a href=\"@file-system\">File system settings</a>, <a href=\"@clean-url\">Clean URL support</a>, <a href=\"@site-info\">Site name and other information</a>, and a <a href=\"@maintenance-mode\">Maintenance mode</a> for taking your site temporarily offline.','','7.23'),(3702,'','default','Configuring actions','','7.23'),(3703,'','default','Actions are individual tasks that the system can do, such as unpublishing a piece of content or banning a user. Modules, such as the <a href=\"@trigger-help\">Trigger module</a>, can fire these actions when certain system events happen; for example, when a new post is added or when a user logs in. Modules may also provide additional actions. Visit the <a href=\"@actions\">Actions page</a> to configure actions.','','7.23'),(3704,'','default','Set and configure the default theme for your website.  Alternative <a href=\"@themes\">themes</a> are available.','','none'),(3705,'','default','Download additional <a href=\"@modules\">contributed modules</a> to extend Drupal\'s functionality.','','7.23'),(3706,'','default','Regularly review and install <a href=\"@updates\">available updates</a> to maintain a secure and current site. Always run the <a href=\"@update-php\">update script</a> each time a module is updated.','','7.23'),(3707,'','default','Regularly review <a href=\"@updates\">available updates</a> to maintain a secure and current site. Always run the <a href=\"@update-php\">update script</a> each time a module is updated.','','none'),(3708,'','default','Regularly review available updates to maintain a secure and current site. Always run the <a href=\"@update-php\">update script</a> each time a module is updated. Enable the Update manager module to update and install modules and themes.','','none'),(3709,'','default','If you are upgrading to a newer version of Drupal or upgrading contributed modules or themes, you may need to run the <a href=\"@update-php\">update script</a>.','','none'),(3710,'','default','There 