ace.','','7.23'),(3773,'','default','Content workflow, editorial workflow tools.','','7.23'),(3774,'','default','Content authoring','','7.23'),(3775,'','default','Settings related to formatting and authoring content.','','7.23'),(3776,'','default','The host !host is no longer blocked because it is not a valid IP address.','','none'),(3777,'','default','Inserted into {role_permission} the permissions for role ID !id','','none'),(3778,'','default','Aggressive caching was disabled and replaced with normal caching. Read the page caching section in default.settings.php for more information on how to enable similar functionality.','','none'),(3779,'','default','%profile_name (%profile-%version)','','none'),(3780,'','default','more information','','none'),(3781,'','default','The phpinfo() function has been disabled for security reasons. To see your server\'s phpinfo() information, change your PHP settings or contact your server administrator. For more information, <a href=\"@phpinfo\">Enabling and disabling phpinfo()</a> handbook page.','','none'),(3782,'','default','To run cron from outside the site, go to <a href=\"!cron\">!cron</a>','','none'),(3783,'','default','An automated attempt to create this directory failed, possibly due to a permissions problem. To proceed with the installation, either create the directory and modify its permissions manually or ensure that the installer has the permissions to create it automatically. For more information, see INSTALL.txt or the <a href=\"@handbook_url\">online handbook</a>.','','none'),(3784,'','default','Your configuration has been saved.','','none'),(3785,'','default','No vocabularies available. <a href=\"@link\">Add vocabulary</a>.','','none'),(3786,'','default','No terms available. <a href=\"@link\">Add term</a>.','','none'),(3787,'','default','There is currently no content classified with this term.','','7.23'),(3788,'','default','Tokens related to taxonomy terms.','','7.23'),(3789,'','default','Tokens related to taxonomy vocabularies.','','7.23'),(3790,'','default','The Taxonomy module allows you to classify the content of your website. To classify content, you define <em>vocabularies</em> that contain related <em>terms</em>, and then assign the vocabularies to content types. For more information, see the online handbook entry for the <a href=\"@taxonomy\">Taxonomy module</a>.','','7.23'),(3791,'','default','Creating vocabularies','','7.23'),(3792,'','default','Users with sufficient <a href=\"@perm\">permissions</a> can create <em>vocabularies</em> and <em>terms</em> through the <a href=\"@taxo\">Taxonomy page</a>. The page listing the terms provides a drag-and-drop interface for controlling the order of the terms and sub-terms within a vocabulary, in a hierarchical fashion. A <em>controlled vocabulary</em> classifying music by genre with terms and sub-terms could look as follows:','','7.23'),(3793,'','default','<em>vocabulary</em>: Music','','7.23'),(3794,'','default','<em>term</em>: Jazz','','7.23'),(3795,'','default','<em>sub-term</em>: Swing','','7.23'),(3796,'','default','<em>sub-term</em>: Fusion','','7.23'),(3797,'','default','<em>term</em>: Rock','','7.23'),(3798,'','default','<em>sub-term</em>: Country rock','','7.23'),(3799,'','default','<em>sub-term</em>: Hard rock','','7.23'),(3800,'','default','You can assign a sub-term to multiple parent terms. For example, <em>fusion</em> can be assigned to both <em>rock</em> and <em>jazz</em>.','','7.23'),(3801,'','default','Terms in a <em>free-tagging vocabulary</em> can be built gradually as you create or edit content. This is often done used for blogs or photo management applications.','','7.23'),(3802,'','default','Assigning vocabularies to content types','','7.23'),(3803,'','default','Before you can use a new vocabulary to classify your content, a new Taxonomy term field must be added to a <a href=\"@ctedit\">content type</a> on its <em>manage fields</em> page. When adding a taxonomy field, you choose a <em>widget</em> to use to enter the taxonomy information on the content editing page: a select list, checkboxes, radio buttons, or an auto-complete field (to build a free-tagging vocabulary). After choosing the field type and widget, on the subsequent <em>field settings</em> page you can choose the desired vocabulary, whether one or multiple terms can be chosen from the vocabulary, and other settings. The same vocabulary can be added to multiple content types, by using the \"Add existing field\" section on the manage fields page.','','7.23'),(3804,'','default','Classifying content','','7.23'),(3805,'','default','After the vocabulary is assigned to the content type, you can start classifying content. The field with terms will appear on the content editing screen when you edit or <a href=\"@addnode\">add new content</a>.','','7.23'),(3806,'','default','Viewing listings and RSS feeds by term','','7.23'),(3807,'','default','Each taxonomy term automatically provides a page listing content that has its classification, and a corresponding RSS feed. For example, if the taxonomy term <em>country rock</em> has the ID 123 (you can see this by looking at the URL when hovering on the linked term, which you can click to navigate to the listing page), then you will find this list at the path <em>taxonomy/term/123</em>. The RSS feed will use the path <em>taxonomy/term/123/feed</em> (the RSS icon for this term\'s listing will automatically display in your browser\'s address bar when viewing the listing page).','','7.23'),(3808,'','default','Extending Taxonomy module','','7.23'),(3809,'','default','There are <a href=\"@taxcontrib\">many contributed modules</a> that extend the behavior of the Taxonomy module for both display and organization of terms.','','7.23'),(3810,'','default','Taxonomy is for categorizing content. Terms are grouped into vocabularies. For example, a vocabulary called \"Fruit\" would contain the terms \"Apple\" and \"Banana\".','','none'),(3811,'','default','You can reorganize the terms in %capital_name using their drag-and-drop handles, and group terms under a parent term by sliding them under and to the right of the parent.','','none'),(3812,'','default','%capital_name contains terms grouped under parent terms. You can reorganize the terms in %capital_name using their drag-and-drop handles.','','none'),(3813,'','default','%capital_name contains terms with multiple parents. Drag and drop of terms with multiple parents is not supported, but you can re-enable drag-and-drop support by editing each term to include only a single parent.','','none'),(3814,'','default','Administer vocabularies and terms','','7.23'),(3815,'','default','Edit terms in %vocabulary','','7.23'),(3816,'','default','Delete terms from %vocabulary','','7.23'),(3817,'','default','Taxonomy term page','','7.23'),(3818,'','default','Term reference','','7.23'),(3819,'','default','This field stores a reference to a taxonomy term.','','7.23'),(3820,'','default','Autocomplete term widget (tagging)','','7.23'),(3821,'','default','The vocabulary which supplies the options for this field.','','none'),(3822,'','default','The Toolbar module displays links to top-level administration menu items and links from other modules at the top of the screen. For more information, see the online handbook entry for <a href=\"@toolbar\">Toolbar module</a>.','','7.23'),(3823,'','default','Displaying administrative links','','7.23'),(3824,'','default','Use the administration toolbar','','7.23'),(3825,'','default','Toggle drawer visibility','','7.23'),(3826,'','default','Provides a toolbar that shows the top-level administration menu items and links from other modules.','','7.23'),(3827,'','default','The Tracker module displays the most recently added and updated content on your site, and allows you to follow new content created by each user. This module has no configuration options. For more information, see the online handbook entry for <a href=\"@tracker\">Tracker module</a>.','','none'),(3828,'','default','The Tracker module adds a new menu item to the Navigation menu, called <em>Recent content</em>. You can configure menu items via the <a href=\"@menus\">Menus administration page</a>.','','none'),(3829,'','default','Tracking new and updated site content','','none'),(3830,'','default','The <a href=\'@recent\'>Recent content</a> page shows new and updated content in reverse chronological order, listing the content type, title, author\'s name, number of comments, and time of last update. Content is considered updated when changes occur in the text, or when new comments are added. The <em>My recent content</em> tab limits the list to the currently logged-in user.','','none'),(3831,'','default','Tracking user-specific content','','none'),(3832,'','default','To follow a specific user\'s new and updated content, select the <em>Track</em> tab from the user\'s profile page.','','none'),(3833,'','default','All recent content','','none'),(3834,'','default','My recent content','','none'),(3835,'','default','Track content','','none'),(3836,'','default','Enables tracking of recent content for users.','','7.23'),(3837,'','default','The Content translation module allows content to be translated into different languages. Working with the <a href=\"@locale\">Locale module</a> (which manages enabled languages and provides translation for the site interface), the Content translation module is key to creating and maintaining translated site content. For more information, see the online handbook entry for <a href=\"@translation\">Content translation module</a>.','','none'),(3838,'','default','Configuring content types for translation','','none'),(3839,'','default','To configure a particular content type for translation, visit the <a href=\"@content-types\">Content types</a> page, and click the <em>edit</em> link for the content type. In the <em>Publishing options</em> section, select <em>Enabled, with translation</em> under <em>Multilingual support</em>.','','none'),(3840,'','default','Assigning a language to content','','none'),(3841,'','default','Use the <em>Language</em> drop down to select the appropriate language when creating or editing content.','','none'),(3842,'','default','Translating content','','none'),(3843,'','default','Users with the <em>translate content</em> permission can translate content, if the content type has been configured to allow translations. To translate content, select the <em>Translation</em> tab when viewing the content, select the language for which you wish to provide content, and then enter the content.','','none'),(3844,'','default','Maintaining translations','','none'),(3845,'','default','If editing content in one language requires that translated versions also be updated to reflect the change, use the <em>Flag translations as outdated</em> check box to mark the translations as outdated and in need of revision. Individual translations may also be marked for revision by selecting the <em>This translation needs to be updated</em> check box on the translation editing form.','','none'),(3846,'','default','Translate content','','none'),(3847,'','default','There is already a translation in this language.','','none'),(3848,'','default','Trigger: !description','','none'),(3849,'','default','No actions available for this trigger. <a href=\"@link\">Add action</a>.','','none'),(3850,'','default','Missing/undefined save action (%save_aid) for %aid action.','','none'),(3851,'','default','The %label action has been appended, which is required to save the property change.','','none'),(3852,'','default','The %label action was moved to save the property change.','','none'),(3853,'','default','Triggers are events on your site, such as new content being added or a user logging in. The Trigger module associates these triggers with actions (functional tasks), such as unpublishing content containing certain keywords or e-mailing an administrator. The <a href=\"@url\">Actions settings page</a> contains a list of existing actions and provides the ability to create and configure advanced actions (actions requiring configuration, such as an e-mail address or a list of banned words).','','none'),(3854,'','default','The Trigger module provides the ability to cause <em>actions</em> to run when certain <em>triggers</em> take place on your site. Triggers are events, such as new content being added to your site or a user logging in, and actions are tasks, such as unpublishing content or e-mailing an administrator. For more information, see the online handbook entry for <a href=\"@trigger\">Trigger module</a>.','','none'),(3855,'','default','Configuring triggers and actions','','none'),(3856,'','default','The combination of actions and triggers can perform many useful tasks, such as e-mailing an administrator if a user account is deleted, or automatically unpublishing comments that contain certain words. To set up a trigger/action combination, first visit the <a href=\"@actions-page\">Actions configuration page</a>, where you can either verify that the action you want is already listed, or create a new <em>advanced</em> action. You will need to set up an advanced action if there are configuration options in your trigger/action combination, such as specifying an e-mail address or a list of banned words. After configuring or verifying your action, visit the <a href=\"@triggers-page\">Triggers configuration page</a> and choose the appropriate tab (Comment, Taxonomy, etc.), where you can assign the action to run when the trigger event occurs.','','none'),(3857,'','default','When either saving new content or updating existing content','','none'),(3858,'','default','After saving updated content','','none'),(3859,'','default','When either saving a new comment or updating an existing comment','','none'),(3860,'','default','After creating a new user account','','none'),(3861,'','default','After updating a user account','','none'),(3862,'','default','Configure when to execute actions.','','none'),(3863,'','default',