 to perform updates directly through the administration interface. At the top of the <a href=\"@modules_page\">modules</a> and <a href=\"@themes_page\">themes</a> pages you will see a link to update to new releases. This will direct you to the <a href=\"@update-page\">update page</a> where you see a listing of all the missing updates and confirm which ones you want to upgrade. From there, you are prompted for your FTP/SSH password, which then transfers the files into your Drupal installation, overwriting your old files. More detailed instructions can be found in the <a href=\"@update\">online handbook</a>.','','7.23'),(3933,'','default','Installing new modules and themes through the user interface','','7.23'),(3934,'','default','You can also install new modules and themes in the same fashion, through the <a href=\"@install\">install page</a>, or by clicking the <em>Install new module/theme</em> link at the top of the <a href=\"@modules_page\">modules</a> and <a href=\"@themes_page\">themes</a> pages. In this case, you are prompted to provide either the URL to the download, or to upload a packaged release file from your local computer.','','7.23'),(3935,'','default','No update information available. <a href=\"@run_cron\">Run cron</a> or <a href=\"@check_manually\">check manually</a>.','','7.23'),(3936,'','default','You can automatically install your missing updates using the Update manager:','','none'),(3937,'','default','Your site is currently configured to send these emails when any updates are available. To get notified only for security updates, !url.','','7.23'),(3938,'','default','Your site is currently configured to send these emails only when security updates are available. To get notified for any available updates, !url.','','none'),(3939,'','default','The installed version of at least one of your modules or themes is no longer supported. Upgrading or disabling is strongly recommended. See the project homepage for more details.','','none'),(3940,'','default'