e or more roles. By default there are two roles: <em>anonymous user</em> (users that are not logged in) and <em>authenticated user</em> (users that are registered and logged in). Depending on choices you made when you installed Drupal, the installation process may have defined more roles, and you can create additional custom roles on the <a href=\"@roles\">Roles page</a>. After creating roles, you can set permissions for each role on the <a href=\"@permissions_user\">Permissions page</a>. Granting a permission allows users who have been assigned a particular role to perform an action on the site, such as viewing a particular type of content, editing or creating content, administering settings for a particular module, or using a particular function of the site (such as search).','','7.23'),(4013,'','default','The <a href=\"@accounts\">Account settings page</a> allows you to manage settings for the displayed name of the anonymous user role, personal contact forms, user registration, and account cancellation. On this page you can also manage settings for account personalization (including signatures and user pictures), and adapt the text for the e-mail messages that are sent automatically during the user registration process.','','7.23'),(4014,'','default','By default, Drupal comes with two user roles:','','none'),(4015,'','default','Anonymous user: this role is used for users that don\'t have a user account or that are not authenticated.','','none'),(4016,'','default','Authenticated user: this role is automatically granted to all logged in users.','','none'),(4017,'','default','This form lets administrators add, edit, and arrange fields for storing user data.','','none'),(4018,'','default','This form lets administrators configure how fields should be displayed when rendering a user profile page.','','none'),(4019,'','default','User module timezone form element.','','7.23'),(4020,'','default','User module history view element.','','7.23'),(4021,'','default','Administer