),(4120,'','default','Cannot add primary key to table %table: table doesn\'t exist.','','none'),(4121,'','default','Cannot add primary key to table %table: primary key already exists.','','none'),(4122,'','default','Cannot add unique key %name to table %table: table doesn\'t exist.','','none'),(4123,'','default','Cannot add unique key %name to table %table: unique key already exists.','','none'),(4124,'','default','Cannot add index %name to table %table: table doesn\'t exist.','','none'),(4125,'','default','Cannot add index %name to table %table: index already exists.','','none'),(4126,'','default','Cannot change the definition of field %table.%name: field doesn\'t exist.','','none'),(4127,'','default','Cannot rename field %table.%name to %name_new: target field already exists.','','none'),(4128,'','default','Use this page to create a new custom block.','','none'),(4129,'','default','Number of recent blog posts to display','','none'),(4130,'','default','@node_type comment','','7.23'),(4131,'','default','Edit comment %comment','','none'),(4132,'','default','The Field UI module provides an administrative user interface (UI) for attaching and managing fields. Fields can be defined at the content-type level for content items and comments, at the vocabulary level for taxonomy terms, and at the site level for user accounts. Other modules may also enable fields to be defined for their data. Field types (text, image, number, etc.) are defined by modules, and collected and managed by the <a href=\"@field\">Field module</a>. For more information, see the online handbook entry for <a href=\"@field_ui\" target=\"_blank\">Field UI module</a>.','','7.23'),(4133,'','default','Planning fields','','7.23'),(4134,'','default','What the field will be called','','7.23'),(4135,'','default','A field has a <em>label</em> (the name displayed in the user interface) and a <em>machine name</em> (the name used internally). The label can be changed after you create the field, if needed, but the machine name cannot be changed after you have created the field.','','7.23'),(4136,'','default','What type of data the field will store','','7.23'),(4137,'','default','Each field can store one type of data (text, number, file, etc.). When you define a field, you choose a particular <em>field type</em>, which corresponds to the type of data you want to store. The field type cannot be changed after you have created the field.','','7.23'),(4138,'','default','How the data will be input and displayed','','7.23'),(4139,'','default','How many values the field will store','','7.23'),(4140,'','default','You can store one value, a specific maximum number of values, or an unlimited number of values in each field. For example, an employee identification number field might store a single number, whereas a phone number field might store multiple phone numbers. This setting can be changed after you have created the field, but if you reduce the maximum number of values, you may lose information.','','7.23'),(4141,'','default','Reusing fields','','7.23'),(4142,'','default','Once you have defined a field, you can reuse it. For example, if you define a custom image field for one content type, and you need to have an image field with the same parameters on another content type, you can add the same field to the second content type, in the <em>Add existing field</em> area of the user interface. You could also add this field to a taxonomy vocabulary, comments, user accounts, etc.','','7.23'),(4143,'','default','Some settings of a reused field are unique to each use of the field; others are shared across all places you use the field. For example, the label of a text field is unique to each use, while the setting for the number of values is shared.','','7.23'),(4144,'','default','There are two main reasons for reusing fields. First, reusing fields can save you time over defining new fields. Second, reusing fields also allows you to display, filter, group, and sort content together by field across content types. For example, the contributed Views module allows you to create lists and tables of content. So if you use the same field on multiple content types, you can create a View containing all of those content types together displaying that field, sorted by that field, and/or filtered by that field.','','7.23'),(4145,'','default','Fields on content items','','7.23'),(4146,'','default','Fields on content items are defined at the content-type level, on the <em>Manage fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you define a field for a content type, each content item of that type will have that field added to it. Some fields, such as the Title and Body, are provided for you when you create a content type, or are provided on content types created by your installation profile.','','7.23'),(4147,'','default','Fields on taxonomy terms','','7.23'),(4148,'','default','Fields on taxonomy terms are defined at the taxonomy vocabulary level, on the <em>Manage fields</em> tab of the vocabulary edit page (which you can reach from the <a href=\"@taxonomy\">Taxonomy page</a>). When you define a field for a vocabulary, each term in that vocabulary will have that field added to it. For example, you could define an image field for a vocabulary to store an icon with each term.','','7.23'),(4149,'','default','Fields on user accounts','','7.23'),(4150,'','default','Fields on user accounts are defined on a site-wide basis on the <a href=\"@fields\">Manage fields tab</a> of the <a href=\"@accounts\">Account settings</a> page. When you define a field for user accounts, each user account will have that field added to it. For example, you could add a long text field to allow users to include a biography.','','7.23'),(4151,'','default','Fields on comments','','7.23'),(4152,'','default','Fields on comments are defined at the content-type level, on the <em>Comment fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you add a field for comments, each comment on a content item of that type will have that field added to it. For example, you could add a website field to the comments on forum posts, to allow forum commenters to add a link to their website.','','7.23'),(4153,'','default','Administer text formats and filters','','7.23'),(4154,'','default','@type language detection','','none'),(4155,'','default','Strings in the uploaded file replace existing ones, new ones are added. The plural format is updated.','','none'),(4156,'','default','Existing strings and the plural format are kept, only new strings are added.','','none'),(4157,'','default','Define how to decide which language is used to display page elements (primarily text provided by Drupal and modules, such as field labels and help text). This decision is made by evaluating a series of detection methods for languages; the first detection method that gets a result will determine which language is used for that type of text. Define the order of evaluation of language detection methods on this page.','','none'),(4158,'','default','User interface text','','7.23'),(4159,'','default','Use the detected interface language.','','7.23'),(4160,'','default','Add new %type','','none'),(4161,'','default','The new set is created by copying items from your default shortcut set.','','none'),(4162,'','default','The new set is created by copying items from the %default set.','','none'),(4163,'','default','You are currently using the %set-name shortcut set.','','none'),(4164,'','default','edit set name','','none'),(4165,'','default','delete set','','none'),(4166,'','default','Create new set','','none'),(4167,'','default','The %set_name shortcut set has been created. You can edit it from this page.','','none'),(4168,'','default','Updated set name to %set-name.','','none'),(4169,'','default','If you have chosen this shortcut set as the default for some or a