your website.','','none'),(4216,'','default','A date in \'time-since\' format. (%date)','','7.23'),(4217,'','default','The location of the file relative to Drupal root.','','7.23'),(4218,'','default','HTTP error @errorcode occurred when trying to fetch @remote.','','none'),(4219,'','default','Your system or network configuration does not allow Drupal to access web pages, resulting in reduced functionality. This could be due to your webserver configuration or PHP settings, and should be resolved in order to download information about available updates, fetch aggregator feeds, sign in via OpenID, or use other network-dependent services. If you are certain that Drupal can access web pages but you are still seeing this message, you may add <code>$conf[\'drupal_http_request_fails\'] = FALSE;</code> to the bottom of your settings.php file.','','none'),(4220,'','default','A translation of %title in %language already exists, a new %type will be created instead of a translation.','','none'),(4221,'','default','Your modules have been downloaded and updated.','','none'),(4222,'','default','<a href=\"@update\">Run database updates</a>','','none'),(4223,'','default','@name <em>(locked)</em>','','none'),(4224,'','default','Are you sure you want to delete the role %name ?','','none'),(4225,'','default','Permissions let you control what users can do and see on your site. You can define a specific set of permissions for each role. (See the <a href=\"@role\">Roles</a> page to create a role). Two important roles to consider are Authenticated Users and Administrators. Any permissions granted to the Authenticated Users role will be given to any user who can log into your site. You can make any role the Administrator role for the site, meaning this will be granted all new permissions automatically. You can do this on the <a href=\"@settings\">User Settings</a> page. You should be careful to ensure that only trusted users are given this access and level of control of your site.','','none'),(4226,'','default','Roles allow you to fine tune the security and administration of Drupal. A role defines a group of users that have certain privileges as defined on the <a href=\"@permissions\">permissions page</a>. Examples of roles include: anonymous user, authenticated user, moderator, administrator and so on. In this area you will define the names and order of the roles on your site. It is recommended to order your roles from least permissive (anonymous user) to most permissive (administrator). To delete a role choose \"edit role\".','','none'),(4227,'','default','Use <em>articles</em> for time-sensitive content like news, press releases or blog posts.','','7.23'),(4228,'','default','Filipino','','none'),(4229,'','default','Swiss German','','none'),(4230,'','default','Scots','','none'),(4231,'; modules/file/file.js','default','The selected file %filename cannot be uploaded. Only files with the following extensions are allowed: %extensions.','','none'),(4232,'','default','Cache pages for anonymous users','','none'),(4233,'','default','Bartik','','7.23'),(4234,'','default','A flexible, recolorable theme with many regions.','','none'),(4235,'','default','Highlighted','','7.23'),(4236,'','default','Sidebar second','','7.23'),(4237,'','default','Triptych first','','7.23'),(4238,'','default','Triptych middle','','7.23'),(4239,'','default','Triptych last','','7.23'),(4240,'','default','Main background','','none'),(4241,'','default','Sidebar background','','none'),(4242,'','default','Sidebar borders','','none'),(4243,'','default','Footer background','','none'),(4244,'','default','Plum','','none'),(4245,'','default','!local-task-title!active','','7.23'),(4246,'','default','A space-separated list of HTML tags allowed in the content of feed items. Disallowed tags are stripped from the content.','','none'),(4247,'','default','%field may only contain characters a-z, underscores, or hyphens.','','none'),(4248,'','default','%field cannot contain any markup.','','none'),(4249,'','default','No URL aliases available. <a href=\"@link\">Add URL alias</a>.','','none'),(4250,'','default','To provide keyword searching, the search engine maintains an index of words found in the content and its fields, along with text added to your content by other modules (such as comments from the core Comment module, and taxonomy terms from the core Taxonomy module). To build and maintain this index, a correctly configured <a href=\"@cron\">cron maintenance task</a> is required. Users with <em>Administer search</em> permission can further configure the cron settings on the <a href=\"@searchsettings\">Search settings page</a>.','','7.23'),(4251,'','default','Content reindexing','','7.23'),(4252,'','default','Content-related actions on your site (creating, editing, or deleting content and comments) automatically cause affected content items to be marked for indexing or reindexing at the next cron run. When content is marked for reindexing, the previous content remains in the index until cron runs, at which time it is replaced by the new content. Unlike content-related actions, actions related to the structure of your site do not cause affected content to be marked for reindexing. Examples of structure-related actions that affect content include deleting or editing taxonomy terms, enabling or disabling modules that add text to content (such as Taxonomy, Comment, and field-providing modules), and modifying the fields or display parameters of your content types. If you take one of these actions and you want to ensure that the search index is updated to reflect your changed site structure, you can mark all content for reindexing by clicking the \"Re-index site\" button on the <a href=\"@searchsettings\">Search settings page</a>. If you have a lot of content on your site, it may take several cron runs for the content to be reindexed.','','7.23'),(4253,'','default','Cached pages will not be re-created until at least this much time has elapsed.','','none'),(4254,'',