tted links are displayed; for example, if a user is not a member of a role with the permissions <em>Administer permissions</em> (user module) and <em>Administer users</em> (user module), the <em>User management</em> menu item is not displayed.','','7.23'),(7301,'/mobile-adaptive?page_path=admin/modules','default','Provides a dropdown menu to most administrative tasks and other common destinations (to users with the proper permissions).','','7.23'),(7302,'/mobile-adaptive?page_path=admin/modules','default','A better Toolbar.','','7.23'),(7303,'/mobile-adaptive?page_path=admin/modules','default','Performs bulk exporting of data objects known about by Chaos tools.','','7.23'),(7304,'/mobile-adaptive?page_path=admin/modules','default','A library of helpful tools by Merlin of Chaos.','','7.23'),(7305,'/mobile-adaptive?page_path=admin/modules','default','Shows how to use the power of Chaos AJAX.','','7.23'),(7306,'/mobile-adaptive?page_path=admin/modules','default','Shows how an external module can provide ctools plugins (for Panels, etc.).','','7.23'),(7307,'/mobile-adaptive?page_path=admin/modules','default','Introduction','','7.23'),(7308,'/mobile-adaptive?page_path=admin/modules','default','What You See Is What You Get','','7.23'),(7309,'/mobile-adaptive?page_path=admin/modules','default','WYSIWYG','','7.23'),(7310,'/mobile-adaptive?page_path=admin/modules','default','The CKEditor module allows Drupal to replace textarea fields with CKEditor. CKEditor is an online rich text editor that can be embedded inside web pages. It is a !wysiwyg editor which means that the text edited in it looks as similar as possible to the results end users will see after the document gets published. It brings to the Web popular editing features found in desktop word processors such as Microsoft Word and OpenOffice.org Writer. CKEditor is truly lightweight and does not require any kind of installation on the client computer.','','7.23'),(7311,'/mobile-adaptive?page_path=admin/modules','defau