cent log messages</a> page. The log is a chronological list of recorded events containing usage data, performance data, errors, warnings and operational information. Administrators should check the log on a regular basis to ensure their site is working properly.','','7.23'),(7381,'/mobile-adaptive?page_path=admin/modules','default','In case of errors or problems with the site, the <a href=\"@dblog\">Recent log messages</a> page can be useful for debugging, since it shows the sequence of events. The log messages include usage information, warnings, and errors.','','7.23'),(7382,'/mobile-adaptive?page_path=admin/modules','default','Allows deletion of all nodes, comments and users on a site. Useful for development or prior to launching a site.','','7.23'),(7383,'/mobile-adaptive?page_path=admin/modules','default','Various blocks, pages, and functions for developers.','','7.23'),(7384,'/mobile-adaptive?page_path=admin/modules','default','Generate dummy users, nodes, and taxonomy terms.','','7.23'),(7385,'/mobile-adaptive?page_path=admin/modules','default','Developer blocks and page illustrating relevant node_access records.','','7.23'),(7386,'/mobile-adaptive?page_path=admin/modules','default','Enables modules to work with any entity type and to provide entities.','','7.23'),(7387,'/mobile-adaptive?page_path=admin/modules','default','Provides token replacements for all properties that have no tokens and are known to the entity API.','','7.23'),(7388,'/mobile-adaptive?page_path=admin/modules','default','Provides feature management for Drupal.','','7.23'),(7389,'/mobile-adaptive?page_path=admin/modules','default','The Field module allows custom data fields to be defined for <em>entity</em> types (entities include content items, comments, user accounts, and taxonomy terms). The Field module takes care of storing, loading, editing, and rendering field data. Most users will not interact with the Field module directly, but will instead use the <a href=\"@field-ui-help\">Field UI module</a> user interface. Module developers can use the Field API to make new entity types \"fieldable\" and thus allow fields to be attached to them. For more information, see the online handbook entry for <a href=\"@field\">Field module</a>.','','7.23'),(7390,'/mobile-adaptive?page_path=admin/modules','default','There are several decisions you will need to make before defining a field for content, comments, etc.:','','7.23'),(7391,'/mobile-adaptive?page_path=admin/modules','default','Each field type has one or more available <em>widgets</em> associated with it; each widget provides a mechanism for data input when you are editing (text box, select list, file upload, etc.). Each field type also has one or more display options, which determine how the field is displayed to site visitors. The widget and display options can be changed after you have created the field.','','7.23'),(7392,'/mobile-adaptive?page_path=admin/modules','default','Extends Drupal file entities to be fieldable and viewable.','','7.23'),(7393,'/mobile-adaptive?page_path=admin/modules','default','After you create an image style, you can add effects: crop, scale, resize, rotate, and desaturate (other contributed modules provide additional effects). For example, by combining effects as crop, scale, and desaturate, you can create square, grayscale thumbnails.','','7.23'),(7394,'/mobile-adaptive?page_path=admin/modules','default','An image/file uploader and browser supporting personal directories and user quota.','','7.23'),(7395,'','default','Update jQuery and jQuery UI to a more recent version.','','7.23'),(7396,'/mobile-adaptive?page_path=admin/modules','default','Allows version-dependent and shared usage of external libraries.','','7.23'),(7397,'/mobile-adaptive?page_path=admin/modules','default','The Menu module provides an interface for managing menus. A menu is a hierarchical collection of links, which can be within or external to the site, generally used for navigation. Each menu is rendered in a block that can be enabled and positioned through the <a href=\"@blocks\">Blocks administration page</a>. You can view and manage menus on the <a href=\"@menus\">Menus administration page</a>. For more information, see the online handbook entry for the <a href=\"@menu\">Menu module</a>.','','7.23'),(7398,'/mobile-adaptive?page_path=admin/modules','default','Allows to test web-site in mobile device emulator.','','7.23'),(7399,'/mobile-adaptive?page_path=admin/modules','default','Filter the modules list.','','7.23'),(7400,'/mobile-adaptive?page_path=admin/modules','default','Provides a UI and API to manage pages within the site.','','7.23'),(7401,'/mobile-adaptive?page_path=admin/modules','default','Provides a mechanism for modules to automatically generate aliases for the content they manage.','','7.23'),(7402,'/mobile-adaptive?page_path=admin/modules','default','Maximum alias and component length','','7.23'),(7403,'/mobile-adaptive?page_path=admin/modules','default','The <strong>maximum alias length</strong> and <strong>maximum component length</strong> values default to 100 and have a limit of @max from Pathauto. This length is limited by the length of the \"alias\" column of the url_alias database table. The default database schema for this column is @max. If you set a length that is equal to that of the one set in the \"alias\" column it will cause problems in situations where the system needs to append additional words to the aliased URL. You should enter a value that is the length of the \"alias\" column minus the length of any strings that might get added to the end of the URL. The length of strings that might get added to the end of your URLs depends on which modules you have enabled and on your Pathauto settings. The recommended and default value is 100.','','7.23'),(7404,'/mobile-adaptive?page_path=admin/modules','default','Interface and manager for Drupal queues','','7.23'),(7405,'/mobile-adaptive?page_path=admin/modules','default','The RDF module enriches your content with metadata to let other applications (e.g., search engines, aggregators, and so on) better understand its relationships and attributes. This semantically enriched, machine-readable output for Drupal sites uses the <a href=\"@rdfa\">RDFa specification</a> which allows RDF data to be embedded in HTML markup. Other modules can define mappings of their data to RDF terms, and the RDF module makes this RDF data available to the theme. The core Drupal modules define RDF mappings for their data model, and the core Drupal themes output this RDF metadata information along with the human-readable visual information. For more information, see the online handbook entry for <a href=\"@rdf\">RDF module</a>.','','7.23'),(7406,'/mobile-adaptive?page_path=admin/modules','default','Rules documentation is kept online. Please use the links below for more information about Rules. Feel free to contribute to improving the online documentation!','','7.23'),(7407,'/mobile-adaptive?page_path=admin/modules','default','Rules introduction','','7.23'),(7408,'/mobile-adaptive?page_path=admin/modules','default','Rules terminology','','7.23'),(7409,'/mobile-adaptive?page_path=admin/modules','default','Rules Scheduler','','7.23'),(7410,'/mobile-adaptive?page_path=admin/modules','default','Coding for Rules','','7.23'),(7411,'/mobile-adaptive?page_path=admin/modules','default','React on events and conditionally evaluate actions.','','7.23'),(7412,'/mobile-adaptive?page_path=admin/modules','default','Schedule the execution of Rules components using actions.','','7.23'),(7413,'/mobile-adaptive?page_path=admin/modules','default','Allows translating rules.','','7.23'),(7414,'/mobile-adaptive?page_path=admin/modules','default','Administrative interface for managing rules.','','7.23'),(7415,'/mobile-adaptive?page_path=admin/modules','default','Create custom styles for applications such as Panels.','','7.23'),(7416,'/mobile-adaptive?page_path=admin/modules','default','Scrape content fr