,'zh-hans',0,0,0),(2819,'确保每个区块的描述都是唯一的。','zh-hans',0,0,0),(2820,'Block（区块）模块让你可以创建内容的盒状容器，这样你可以将内容放置在一个或多个页面的某个区域中。核心的Seven管理主题，例如，使用了区域 \"Content\"、\"Help\"、\"Dashboard main\" 及 \"Dashboard sidebar\"，区块就可以在其中一个区域进行显示。<a href=\"@blocks\">区块管理</a>页面提供了可区块可拖曳到区域的方式，可用来控制在区域中区块的顺序。更多信息，请查看<a href=\"@block\">Block模块</a>的在线手册条目。','zh-hans',0,0,0),(2821,'安置内容','zh-hans',0,0,0),(2822,'当使用区块时，记住不是所有的主题实现的区域都一样，或会以同样的方式显示区域。区块会基于不同的主题而有不同的变化。具有<em>管理区块</em>权限的用户可以禁用区块。禁用的区块会列在<a href=\"@blocks\">区块管理</a>页面上，不会在在任何区域中显示。','zh-hans',0,0,0),(2823,'控制可见性','zh-hans',0,0,0),(2824,'区块可以设置成特定页面上可见、特定角色用户可见，或特定<a href=\"@content-type\">内容类型</a>的页面上可见。管理员也可以允许用户启用或禁用特定的区块，比如用户在编辑其<a href=\"@user\">我的帐户</a>页面时。一些动态区块，比如由模块生成的区块，只会在特定的页面上显示。','zh-hans',0,0,0),(2825,'创建自定义区块','zh-hans',0,0,0),(2826,'具有<em>管理区块</em>权限的用户可以<a href=\"@block-add\">添加自定义区块</a>，添加的区块也会列在<a href=\"@blocks\">区块管理</a>页面上。一旦创建之后，自定义区块就和默认区块及模块生成的区块一样可以进行使用了。','zh-hans',0,0,0),(2827,'此页面提供了指定区块区域的可拖曳的界面，以及控制区域中区块的顺序。各种主题划分或显示的区域不尽相同，区块也就会基于各个主题进行定位。记住只有在你点击了在页面底部的<em>保存区块</em>按钮之后你所做的更改才会得以保存。点击每个区块的<em>配置</em>链接对其特定的标题及可见性进行设置。','zh-hans',0,0,0),(2828,'演示块区域(@theme)','zh-hans',0,0,0),(2829,'管理区块','zh-hans',0,0,0),(2830,'您的区块的简介。用在<a href=\"@overview\">区块管理页面</a>.','zh-hans',0,0,0),(2831,'个性化区块','zh-hans',0,0,0),(2832,'区块由内容或页面主要内容外的附加信息所组成。使用下面的复选框启用或禁用可选的区块。','zh-hans',0,0,0),(2833,'缓存区块','zh-hans',0,0,0),(2834,'区块缓存未启用因为当前启用了定义内容访问权限的模块。','zh-hans',0,0,0),(2835,'控制构建页面区块的可见性，区块为盒状的内容容器，可以放在网页的某个地方或区域上','zh-hans',0,0,0),(2836,'限制到特定的区块','zh-hans',0,0,0),(2837,'这个区块不能放才这个区域中。','zh-hans',0,0,0),(2838,'用于多用户的博客。每个用户都能有自己的博客。','zh-hans',0,0,0),(2839,'单用户博客','zh-hans',0,0,0),(2840,'每个用户的博客及链接都会自动在用户的主博客页面上显示。当站点有多少用户具有创建博客内容权限时就有多少单用户博客。','zh-hans',0,0,0),(2841,'多用户的博客','zh-hans',0,0,0),(2842,'每个单用户博客的文章都会聚合在一个多用户的博客中，其会使用一个单独的列表显示所有的博客内容。','zh-hans',0,0,0),(2843,'可以在导航菜单上添加一个可选的<em>博客</em>菜单条目，可用来显示站点上的博客内容，以及<em>我的博客</em>项目会显示当前用户的日志。','zh-hans',0,0,0),(2844,'博客模块默认还会创建一个<em>最新日志</em>区块，可以在<a href=\"@blocks\">区块管理</em>页面进行启用。','zh-hans',0,0,0),(2845,'创建新日志','zh-hans',0,0,0),(2846,'启用多用户博客','zh-hans',0,0,0),(2847,'没有可用的手册','zh-hans',0,0,0),(2848,'书籍大纲中允许的内容类型','zh-hans',0,0,0),(2849,'具有 %outline-perm 权限的用户可以添加所有的内容类型。','zh-hans',0,0,0),(2850,'管理书籍大纲','zh-hans',0,0,0),(2851,'Book（手册）模块用于创建结构化多页面的内容，比如站点资源指南、手册及wiki等。它让你可以创建具有章节小节或其他类似结构的内容。更多信息，请查看<a href=\"@book\">Book模块</a>的在线手册条目。','zh-hans',0,0,0),(2852,'添加及管理手册内容','zh-hans',0,0,0),(2853,'你可以对<em>创建</em>、<em>编辑</em>、<em>删除</em>以及<em>在手册中添加内容</em>、<em>创建新手册</em>分配不同的权限。具有<em>管理手册大纲</em>权限的用户通过在编辑内容时选择合适的手册大纲在手册中添加<em>任意</em>类型的内容。他们也可以查看所有手册的列表，并在<a href=\"@admin-book\">手册管理</a>页面上编辑和组织章节标题。','zh-hans',0,0,0),(2854,'手册页有默认的手册导航区块。此区块包含了手册中上一页下一页以及当前页面的上级页面的链接。此区块可以在<a href=\'@admin-block\'>区块管理</a>页面中进行启用。要在手册导航中显示手册页，它们必须添加到手册大纲中。','zh-hans',0,0,0),(2855,'手册可以创建协作性的内容，因为它们让有合适权限的人可以在手册中添加页面，以及将那些页面添加到自定义的内容菜单表格中。','zh-hans',0,0,0),(2856,'印刷书籍','zh-hans',0,0,0),(2857,'具有<em>查看打印版本手册</em>权限的用户可以选择为与手册页面内容底部的<em>打印版本</em>链接来生成用于打印的包含了页面及其所有子页面的手册版本。','zh-hans',0,0,0),(2858,'Book（手册）模块提供了组织收集相关内容页面的功能，也就是所知道的手册。当查看时，内容会自动显示邻近手册页面的链接，提供了创建及复查结构化内容的简单导航系统。','zh-hans',0,0,0),(2859,'大纲特性让你可以讲页面包含到<a href=\"@book\">手册层次</a>中，以及在层次结构中进行移动或<a href=\"@book-admin\">整本手册重排序</a>。','zh-hans',0,0,0),(2860,'创建新手册','zh-hans',0,0,0),(2861,'向书籍中添加内容和子页面','zh-hans',0,0,0),(2862,'查看打印版手册','zh-hans',0,0,0),(2863,'单文档查看手册页及子页面以方便打印。可能很耗性能。','zh-hans',0,0,0),(2864,'<em>手册</em>有内置的层次化导航结构，用于手册或教程。','zh-hans',0,0,0),(2865,'允许用户以大纲形式创建和组织相关的内容','zh-hans',0,0,0),(2866,'Color（颜色）模块让具有<em>管理站点配置</em>权限的用户可以简便地更改兼容主题的配色方案。更多信息，请查看<a href=\"@color\">Color模块</a>的在线手册条目。','zh-hans',0,0,0),(2867,'改变颜色','zh-hans',0,0,0),(2868,'使用颜色模块可以让你很方便地更改链接、背景、文本以及其他主题元素的颜色。要更改兼容主题的颜色设置，选择<a href=\'@configure\'>主题管理</a>上你的主题的<em>设置</em>链接。如果在那个页面上你没有看到拾色器，那么你的主题应该不兼容颜色主题。如果你确定主题确实支持颜色模块，但是拾色器确实没有显示，那么请<a href=\'@troubleshoot\'>按照这些排错步骤</a>。','zh-hans',0,0,0),(2869,'配色模块会在files目录中保存主题相关的样式表的一份修改过的副本。这就是说，当你手动对样式表进行修改之后，<em>你必须再次保存颜色设置，即使你没有作出更改</em>。因为模块的样式表（在files目录中）需要重新进