文件字段时，你可以指定此文件将被存储于<em>公开</em>或<em>私有</em>文件目录中的目录。公开目录中的文件可通过web服务器被直接访问；当公开文件被列出时，会使用文件的直接链接，并且任何知道文件URL的人都可以下载这个文件。私有目录中的文件不能通过web服务器直接访问；当私有文件被列出时，将会使用Drupal路径请求链接。这会增加服务器载入和下载时间，因为Drupal必须启动并解析每个文件下载请求的路径，只允许被许可的访问。','zh-hans',0,0,0),(3072,'出现不可恢复的错误。此表单使用已过期。请刷新此页并重新提交。','zh-hans',0,0,0),(3073,'引用 !name 字段的文件不存在。','zh-hans',0,0,0),(3074,'不能上传 !name 字段的文件。','zh-hans',0,0,0),(3075,'文件字段 !name 的上传目录 %directory 不能创建或不可访问。新上传的文件不能保存于此目录，上传被取消。','zh-hans',0,0,0),(3076,'你的服务器不能显示文件上传进度。文件上传进度须要一个mod_php模式运行PHP的Apache服务器。','zh-hans',0,0,0),(3077,'所有角色都可使用此格式','zh-hans',0,0,0),(3078,'输入格式顺序已保存...','zh-hans',0,0,0),(3079,'添加文本格式','zh-hans',0,0,0),(3080,'所有此输入格式的角色都必须启用并且不能更改。','zh-hans',0,0,0),(3081,'过滤器处理顺序','zh-hans',0,0,0),(3082,'输入格式名必须唯一。名为 %name 的格式已存在。','zh-hans',0,0,0),(3083,'添加了输入格式 %format。','zh-hans',0,0,0),(3084,'输入格式 %format 已被更新...','zh-hans',0,0,0),(3085,'文本格式','zh-hans',0,0,0),(3086,'Filter（过滤器）模块让管理员可以对文本格式进行配置。文本格式指定了内容及评论中允许使用的HTML标签、代码以及其他输入方式，这也是防止恶意用户通过输入方式潜在危害的关键特性。更多信息，请查看<a href=\"@filter\">Filter模块</a>的在线手册条目。','zh-hans',0,0,0),(3087,'在文本上应用过滤器','zh-hans',0,0,0),(3088,'每种输入格式通过使用过滤器对文本进行处理，大多格式都以特定的顺序应用不同的过滤器。每个过滤器都是为某一特定目的而设计的，通常在文本显示出来之前对页面元进行素添加、移除或转换。一个过滤器可以移除未批准的HTML标签，也有在输入链接时自动添加HTML标签使其可以进行点击。','zh-hans',0,0,0),(3089,'定义文本格式','zh-hans',0,0,0),(3090,'默认包含的一个格式为<em>纯文本</em>（会移除所有的HTML标签）。在你安装Drupal时会由配置文档创建额外的输入格式，之后也可以通过<a href=\"@text-formats\">输入格式</a>页面创建更多的格式。','zh-hans',0,0,0),(3091,'选择文本格式','zh-hans',0,0,0),(3092,'输入格式包含更改用户输入的过滤器，例如剔除恶意的HTML或使链接可以点击。过滤器从上至下运行，顺序很重要，因为一个过滤器可能会阻止其他过滤器的效果。比如，当URL转换为链接放在不允许HTML的标签被移除之前，所有的链接都会被移除。当这个情况发生时，过滤器的顺序就需要重新调整了。','zh-hans',0,0,0),(3093,'警告：根据输入格式的配置此权限可能会引起安全问题。','zh-hans',0,0,0),(3094,'使用!text_format文本格式','zh-hans',0,0,0),(3095,'关于文本格式的更多信息','zh-hans',0,0,0),(3096,'限制使用HTML标记','zh-hans',0,0,0),(3097,'将换行符号转换为 HTML（也就是<code>&lt;br&gt;</code>及<code>&lt;p&gt;</code>）','zh-hans',0,0,0),(3098,'将URL转换成链接','zh-hans',0,0,0),(3099,'修正错误及未关闭的HTML','zh-hans',0,0,0),(3100,'将任何HTML显示为纯文本','zh-hans',0,0,0