上选择他们的首选语言，你的站点也可以设置成按照用户浏览器的语言设置进行语言转换。站点内容可以使用<a href=\'@content-help\'>内容翻译模块</a>进行翻译。','zh-hans',0,0,0),(3266,'通过启用多语言，界面文本就可以进行翻译，注册用户可以选择他们的首选语言，作者也可以指定一个特定的语言进行内容发布。可以从Drupal.org网站<a href=\"@translations\">下载语言包</a>。','zh-hans',0,0,0),(3267,'在站点上添加一种受支持的语言。如果你想要的语言没有在<em>语言名称</em>下拉菜单中，点击<em>自定义语言</em>并手动提供一个语言代码及其他相关信息即可。当手工添加语言代码时，确定其是标准的语言代码，因为此语言代码会用于浏览器的语言显示确定。','zh-hans',0,0,0),(3268,'从一个请求/会话参数确定使用的语言。比如：根据 \"language\" 参数，\"http://example.com?language=de\" 会将语言设置成德语。','zh-hans',0,0,0),(3269,'关于添加额外语言支持的更多信息查看<a href=\"@languages\">语言页面</a>。','zh-hans',0,0,0),(3270,'此页面从一个Gettext Portable Object（<em>.po</em>）文件中导入翻译过的字符串。通常是以翻译包（每个翻译包都包含一些<em>.po</em>文件）的一部分进行发布，一个<em>.po</em>文件在离线编辑后就可以进行导入。导入<em>.po</em>文件可能会花费很长的时间。','zh-hans',0,0,0),(3271,'翻译人员可以在此页面上搜索特定的翻译及未翻译的字符串，用于创建或编辑翻译。（注意：对于涉及很多字符串的翻译任务，可能还是<a href=\"@export\">导出</a>字符串使用桌面Gettext编辑器进行离线编辑比较方便。）搜索可限制为特定的文本组或某个特定的语言。','zh-hans',0,0,0),(3272,'管理语言','zh-hans',0,0,0),(3273,'翻译文本','zh-hans',0,0,0),(3274,'对于内容的语言侦测方法顺序。如果一个版本的内容包含在被侦测的语言里面，它将被显示。','zh-hans',0,0,0),(3275,'用户界面文本的语言检测方式的顺序。如果在检测到的语言中用户界面文本有翻译可用，将会显示出来。','zh-hans',0,0,0),(3276,'从URL（路径前缀或域名）确定语言。','zh-hans',0,0,0),(3277,'从请求/会话参数确定语言。','zh-hans',0,0,0),(3278,'从用户的语言参数确定。','zh-hans',0,0,0),(3279,'从浏览器的语言设置确定。','zh-hans',0,0,0),(3280,'语言切换器（@type）','zh-hans',0,0,0),(3281,'检测及选择','zh-hans',0,0,0),(3282,'URL语言检测配置','zh-hans',0,0,0),(3283,'会话语言检测配置','zh-hans',0,0,0),(3284,'本地化','zh-hans',0,0,0),(3285,'本地化日期格式','zh-hans',0,0,0),(3286,'重置日期格式','zh-hans',0,0,0),(3287,'重置本地化日期格式为全局默认格式','zh-hans',0,0,0),(3288,'一月','zh-hans',0,0,0),(3289,'二月','zh-hans',0,0,0),(3290,'三月','zh-hans',0,0,0),(3291,'四月','zh-hans',0,0,0),(3292,'五月','zh-hans',0,0,0),(3293,'六月','zh-hans',0,0,0),(3294,'七月','zh-hans',0,0,0),(3295,'八月','zh-hans',0,0,0),(3296,'九月','zh-hans',0,0,0),(3297,'十月','zh-hans',0,0,0),(3298,'十一月','zh-hans',0,0,0),(3299,'十二月','zh-hans',0,0,0),(3300,'添加链接','zh-hans',0,0,0),(3301,'目前还没有菜单链接。<a href=\"@link\">添加链接</a>。','zh-hans',0,0,0),(3302,'此链接在菜单中显