),(3415,'将内容推荐到首页','zh-hans',0,0,0),(3416,'从首页移除内容','zh-hans',0,0,0),(3417,'更改内容的作者','zh-hans',0,0,0),(3418,'保存内容','zh-hans',0,0,0),(3419,'取消包含关键字内容的发布','zh-hans',0,0,0),(3420,'若内容包含以上任意短语都将被取消发布。短语区分大小写，以英文半角逗号分隔。例如，影帝, 天朝 幼儿园, \"Company, Inc.\"','zh-hans',0,0,0),(3421,'如果站点在内容权限上发生问题，可能需要重建权限缓存。重建缓存会清除内容的所有权限并基于当前模块及设置替换权限。如果内容量巨大或权限设置很复杂，重建缓存可能会花上一段时间。在重建缓存完成后，内容会自动使用新的权限。','zh-hans',0,0,0),(3422,'节点访问权限','zh-hans',0,0,0),(3423,'使用了 1 个权限','zh-hans',0,0,0),(3424,'使用了 @count 个权限','zh-hans',3423,1,0),(3425,'查找及管理内容。','zh-hans',0,0,0),(3426,'管理内容类型，包括默认状态、首页推荐、评论设置等','zh-hans',0,0,0),(3427,'编辑内容类型','zh-hans',0,0,0),(3428,'不要显示发布信息。','zh-hans',0,0,0),(3429,'此站点支持<a href=\"@openid-net\">OpenID</a>，是使用一个用户名及密码登录很多站点的一个很安全的方式。使用OpenID可以减少管理众多网站上的用户名及密码的工作量。','zh-hans',0,0,0),(3430,'如果你已经有一个OpenID了，在下面输入你的OpenID服务器的URL（比如 myusername.openidprovider.com）。下次你登录站点的时候，只需要输入此网址而就不用再输入用户名和密码了。如果高兴的话，你可以输入多个OpenID服务器，只要在下面添加即可。','zh-hans',0,0,0),(3431,'OpenID模块让用户可以使用OpenID登录站点。<a href=\"@openid-net\">OpenID</a>是使用单一用户名和密码登录多个站点的安全方式。它无需特殊的软件，也不需要在任何站点上上分享密码，包括那些已经登录的站点。主要的好处就是用户可以使用单一的密码就可以登录很多站点了。这就意味着你只要更新一次密码，而不需要为各个站点单独地更新密码了。更多信息，请查看<a href=\"@handbook\">OpenID模块</a>的在线手册条目。','zh-hans',0,0,0),(3432,'使用OpenID进行登录','zh-hans',0,0,0),(3433,'要使用OpenID进行登录，用户必须首先拥有一个OpenID帐户。用户可以使用他们的OpenID来创建站点帐户，在已有的帐户上分配一个或多个OpenID，以及使用OpenID进行登录。这减少了注册时的繁琐，为用户提供了便利及安全性。OpenID不能确定一个用户是否是经过授权的用户，因此也需要进行邮件验证。在登录的时候，用户可以使用OpenID的链接进行登录，这链接看上去类似<em>myusername.openidprovider.com</em>。然后站点就会和OpenID服务器进行交互，请求验证用户的身份。如果用户登录到了其OpenID服务器，则服务器返回结果到站点上，开始验证用户。如果用户还没有登录，OpenID服务器会要求用户输入他们的密码。对于已登录站点的用户其OpenID的密码是不可能被站点记录的。','zh-hans',0,0,0),(3434,'你的电子邮件地址一经验证，即可使用OpenID进行登录了。','zh-hans',0,0,0),(3435,'抱歉，此OpenID未能识别。确定你正确输入了你的ID。','zh-hans',0,0,0),(3436,'通过填写下列表单完成注册。如果你已经有了帐户，可以直接<a href=\"@login\">登录</a>然后在\"我的帐户\"下面添加你的OpenID。','zh-hans',0,0,0),(3437,'使用你的OpenID提供商提供的信息进行帐户注册失败，可能是由于以下原因。通过填写下表完成注册。如果已经有一个帐户，可以进行<a href=\"@login\">登录</a>然后在 \"我的帐户\" 下面添加你的OpenID。','zh-hans',0,0,0),(3438,'Overlay模块让你在当前页面点击管理项目链接时把站点的管理页面显示在一个JavaScript浮动层里，而不替换你浏览器窗口中的页面。使用浮动层上的关闭链接返回到你点击链接时正在查看的页面。获得更多信息，请查看<a href=\"@overlay\">Overlay模块</a>在线手册。','zh-hans',0,0,0),(3439,'用overlay访问管理页面','zh-hans',0,0,0),(3440,'在overlay中查看管理页面。','zh-hans',0,0,0),(3441,'在网页的顶层显示Drupal的管理界面','zh-hans',0,0,0),(3442,'指定需要建立别名的系统路径地址。比如：node/28，forum/1，taxonomy/term/1。','zh-hans',0,0,0),(3443,'Path（路径）模块让你可以为系统内部已有的路径地址指定一个别名，或自定义URL链接地址。别名不要和URL转发混淆，后者是将更改过的或不活跃的URL转发到一个新的URL地址上。除了让URL链接的可读性更高，别名还有助于搜索引擎更有效地索引站点内容。在一个内部系统路径上可以使用多个别名。要使路径别名自动化，可以安装第三方的模块<a href=\"@pathauto\">Pathauto</a>。更多信息，请查看<a href=\"@path\">Path模块</a>的在线手册条目。','zh-hans',0,0,0),(3444,'创建别名','zh-hans',0,0,0),(3445,'具有相应<a href=\"@permissions\">权限</a>的用户可以在创建或编辑内容时，选择<em>URL路径设置</em>单元来创建别名。一些别名的示例： ','zh-hans',0,0,0),(3446,'可以为 <em>user/123</em> 指定别名 <em>member/jane-smith</em>','zh-hans',0,0,0),(3447,'可以为 <em>node/456</em> 指定别名 <em>about-us/team</em>','zh-hans',0,0,0),(3448,'管理别名','zh-hans',0,0,0),(3449,'路径模块提供了搜索及查看站点上使用的<a href=\"@aliases\">别名列表</a>的功能。通过那个列表可以添加、编辑及删除别名。','zh-hans',0,0,0),(3450,'通过使用别名为已有的链接地址指定不同的名称 - 比如，别名 \'about\' 对应于链接地址 \'node/1\'。一个链接地址可以有多个别名。','zh-hans',0,0,0),(3451,'管理URL别名','zh-hans',0,0,0),(3452,'创建及编辑URL别名','zh-hans',0,0,0),(3453,'此别名已被占用。','zh-hans',0,0,0),(3454,'也可以为此术语指定一个可以进行访问的其他的URL。使用相对路径末尾不要添加斜杠否则URL别名不会生效。','zh-hans',0,0,0),(3455,'启用文本字段中的PHP执行','zh-hans',0,0,0),(3456,'PHP过滤器使具有适当权限的用户可以添加PHP代码，在站点处理页面时执行。对于受信任的具有PHP经验的用户来说是非常有用及灵活的工具，但是对于那些恶意的或没有经验的用户来说将会引起非常重大和危险的安全隐患。即使是有经验的用户也可能不小心输错PHP代码而危及站点。对于那些最受信任的用户，才给予PHP过滤器的使用权限，所有通过PHP过滤器添加的PHP代码都应当在使用之前进行仔细的检验。可以在Drupal.org找到一些<a href=\"@php-snippets\">PHP片段示例</a>。','zh-hans',0,0,0),(3457,'使用PHP进行设置','zh-hans',0,0,0),(3458,'<p>在站点上添加一个自定义区块，命名为 \"欢迎\"。将输入格式设置为 \"PHP代码\"（或其他支持PHP输入的输入格式），在区块的正文区域添加如下内容：</p>\n<pre>\nprint t(\'欢迎光临！非常感谢您的访问！\');\n</pre>','zh-hans',0,0,0),(3459,'<p>要显示一个注册用户的用户名，使用如下代码：</p>\n<pre>\nglobal $user;\nif ($user->uid) {\n  print t(\'@name，欢迎光临！感谢您的访问！\', array(\'@name\' => format_username($user)));\n}\nelse {\n  print t(\'欢迎光临！感谢您的访问！\');\n}\n</pre>','zh-hans',0,0,0),(3460,'PHP模块已被禁用。任何使用PHP过滤器输入的内容现在都将以纯文本显示。任何使用PHP代码的地方，在敏感信息暴露后都可能造成安全隐患。','zh-hans',0,0,0),(3461,'Poll（投票）模块可以用来创建简单的调查或有相关累计结果的问题。投票是从站点用户及会员那里收集站点反馈的一种非常有效的方式。更多信息，请查看<a href=\"@poll\">Poll模块</a>的在线手册条目。','zh-hans',0,0,0),(3462,'创建投票','zh-hans',0,0,0),(3463,'用户可以在<a href=\"@add-content\">创建内容</a>页面上通过点击投票链接进行投票的创建，然后输入投票的主题，回答选项，然后开始每个选项的投票计数。其状态（关闭或活跃）以及有效期（保持可以进行投票的时间）都可以进行指定。','zh-hans',0,0,0),(3464,'查看投票','zh-hans',0,0,0),(3465,'你可以访问<a href=\"@poll\">投票</a>页面查看当前所有的投票，也可以在<a href=\"@blocks\">区块管理</a>页面启用<em>最近投票</em>区块。要查看或进行某一特定投票，只要点击那个投票本身即可。','zh-hans',0,0,0),(3466,'参与投票','zh-hans',0,0,0),(3467,'取消及更改自己的投票','zh-hans',0,0,0),(3468,'你的投票已取消。','zh-hans',0,0,0),(3469,'要启用以值查看字段，为结果页面输入一个标题。<code>%value</code>会被相应的值所代替，比如一个标题为 \"人们最喜欢的颜色是 %value\" 的页面。这只能应用于一个公共字段。','zh-hans',0,0,0),(3470,'要启用以值查看字段，为结果页面输入一个标题。比如一个标题为 \"聘用的人员\" 的页面。只可用于一个公共字段。','zh-hans',0,0,0),(3471,'Profile（用户文档）模块让站点管理员可以为用户文档指定自定义的字段（比如城市，全名或者年龄等），这些字段也都会显示在<a href=\"@user\">我的帐户</a>单元上。这使得站点用户可以分享更多的个人信息，帮助社区模式的站点通过特定的信息组织用户。更多信息，查看<a href=\"@profile\">Profile模块</a>的在线手册条目。','zh-hans',0,0,0),(3472,'在默认用户文档上添加字段','zh-hans',0,0,0),(3473,'要让用户可以输入更多的个人信息，模块提供了可以添加到默认用户文档上的其他的字段，比如一般额外会添加<em>地点</em>、<em>公司</em>、<em>年龄</em>或<em>个人介绍</em>。','zh-hans',0,0,0),(3474,'用户信息页面','zh-hans',0,0,0),(3475,'用户文档模块提供了很多查看站点用户信息的链接，你可以在主要的<a href=\"@profile\">用户列表</a>页面，或者在文档的特定页面上点击字段链接进行查看。比如，Drupal.org的<a href=\"@profile-country\">加拿大用户</a>列表会显示那些在用户文档<em>城市</em>字段中输入<em>加拿大</em>的所有用户。','zh-hans',0,0,0),(3476,'作者信息区块','zh-hans',0,0,0),(3477,'<em>作者信息区块</em>是由用户文档模块创建的默认区块，可以在<a href=\"@blocks\">区块管理</a>页面上进行启用。其会为站点访客显示他们所阅读内容的作者的相关信息。','zh-hans',0,0,0),(3478,'此页显示已有的会显示在用户的<em>我的帐户</em>页面上的自定义文档字段上。要提供相似或相关的字段结构可以将其放在一个分类里。要添加一个新的分类（或编辑已有分类），编辑一个文档字段并提供一个新的分类名称。','zh-hans',0,0,0),(3479,'通过元数据丰富你的内容，让其他的程序（比如搜索引擎、聚合器）更好地理解内容的关系及参数','zh-hans',0,0,0),(3480,'启用的搜索模块已更改。','zh-hans',0,0,0),(3481,'关键词至少包含 1 个字符以上。','zh-hans',0,0,0),(3482,'关键词至少包含 @count 个字符以上。','zh-hans',3481,1,0),(3483,'以 %keys 搜索 %type。','zh-hans',0,0,0),(3484,'Search（搜索）模块提供了对特定关键字索引及搜索内容的功能，以及通过用户名及邮件搜索用户。更多信息，查看<a href=\"@search-module\">Search模块</a>的在线手册条目。','zh-hans',0,0,0),(3485,'搜索内容和用户','zh-hans',0,0,0),(3486,'具有<em>使用搜索</em>权限的用户可以使用搜索区块及<a href=\"@search\">搜索</a>页面。具有<em>查看已发布内容</em>权限的用户可以搜索包含特定关键字的内容。具有<em>查看用户文档</em>权限的用户可以包含某关键字的用户名，具有<em>管理用户</em>权限的用户还可以通过邮件地址搜索用户。另外，具有<em>使用高级搜索</em>权限的用户可以在<a href=\"@search\">搜索</a>页面上点击<em>高级搜索</em>选项使用更复杂的搜索方式来过滤其搜索结果。','zh-hans',0,0,0),(3487,'使用cron索引内容','zh-hans',0,0,0),(3488,'配置搜索选项','zh-hans',0,0,0),(3489,'索引行为可以在<a href=\"@searchsettings\">搜索设置</a>页面进行调整。具有<em>管理搜索</em>权限的用户可以控制例如<em>每次cron运行索引的条目数量</em>、<em>索引设置</em>（词长度）、<em>动态搜索模块</em>以及<em>内容排行</em>，内容排行让你可以调整搜索结果中索引内容出现的优先级。','zh-hans',0,0,0),(3490,'搜索模块包含了一个默认的<em>搜索表单</em>区块，可以在<a href=\"@blocks\">区块管理</a>页面进行启用及配置。此区块对于具有<em>搜索内容</em>权限的用户才可见。','zh-hans',0,0,0),(3491,'扩展搜索模块','zh-hans',0,0,0),(3492,'默认情况下，搜索模块只支持匹配特定关键字的内容搜索。你可以安装特定语言的语言词干模块（比如用于美语的<a href=\"http://drupal.org/project/porterstemmer\">Porter Stemmer</a>模块），可以让你在搜索引擎中匹配如walk、walking和walked之类的词。另外一种方式是使用第三方的带有词干及部分关键词配配技术的搜索引擎，比如<a href=\"http://drupal.org/project/apachesolr\">Apache Solr</a>或<a href=\"http://drupal.org/project/sphinx\">Sphinx</a>。可以访问Drupal.org下载这些及其他的<a href=\"@contrib-search\">搜索相关模块</a>。','zh-hans',0,0,0),(3493,'<ul>\n<li>检查你的拼写是否正确。</li>\n<li>去除关键词的引号进行单个字词的搜索。<em>bike shed</em> 的搜索结果比 <em>&quot;bike shed&quot;</em> 更多。</li>\n<li>使用 <em>OR</em> 放宽查询条件。<em>bike OR shed</em> 显示的结果通常比 <em>bike shed</em>多。</li>\n</ul>','zh-hans',0,0,0),(3494,'管理搜索','zh-hans',0,0,0),(3495,'使用搜索','zh-hans',0,0,0),(3496,'使用高级搜索','zh-hans',0,0,0),(3497,'配置搜索及其他索引选项的相关设置。','zh-hans',0,0,0),(3498,'选择一组快捷方式进行使用','zh-hans',0,0,0),(3499,'为此用户选择一组快捷方式','zh-hans',0,0,0),(3500,'你当前正在使用新的 %set_name 快捷方式组。你可以在此页面或<a href=\"@switch-url\">切换到不同组</a>对其进行编辑。','zh-hans',0,0,0),(3501,'%user 正在使用名为 %set_name 的新快捷方式组。你可以在此页面进行编辑。','zh-hans',0,0,0),(3502,'你现在正在使用 %set_name 快捷方式组。','zh-hans',0,0