看。测试ID可以在数据库，simpletest表中找到，或在首次查看这些结果时进行记录。另外，一些模块能提供更详尽的分析及功能，此时需要禁用此设置。','zh-hans',0,0,0),(3547,'GSS协商','zh-hans',0,0,0),(3548,'NTLM','zh-hans',0,0,0),(3549,'任意安全','zh-hans',0,0,0),(3550,'Testing（测试）模块提供了自动化的单元测试的框架。可以用来验证代码更改之后Drupal站点的工作状况，或用于站点开发，编写及执行模块的测试。更多信息，请查看<a href=\"@simpletest\">Testing模块</a>的在线手册条目。','zh-hans',0,0,0),(3551,'运行测试','zh-hans',0,0,0),(3552,'访问<a href=\"@admin-simpletest\">测试</a>页面，有一系列可用的测试。对于综合测试，选择<em>所有</em>测试，更具目标化的测试可以单独选中进行测试。注意全部测试完成可能需要花费一些时间。更多关于创建及修改自己的测试方面的信息，请查看Drupal手册中的<a href=\"@simpletest-api\">Testing API </a>文档。','zh-hans',0,0,0),(3553,'在测试运行后，会在每个测试组旁边显示测试通过、失败还是中断的消息。通过就意味着返回了所期望的结果，当然失败就是没有了。中断通常是指测试时外部发生了错误，比如一个PHP警告或通知。如果没有失败或终端，测试结果就会显示详细信息，测试失败或终端则会以红色或粉色的行进行指示。然后你就可以使用这些结果调整你的代码和测试，直到测试通过为止。','zh-hans',0,0,0),(3554,'管理测试','zh-hans',0,0,0),(3555,'测试于 @elapsed 后结束。','zh-hans',0,0,0),(3556,'使用<em>清理环境</em>按钮清理临时文件和表。','zh-hans',0,0,0),(3557,'测试框架需要禁用PHP的<a href=\"@open_basedir-url\">open_basedir</a>。检查web服务器配置或联系你的主机服务提供商。','zh-hans',0,0,0),(3558,'测试框架未能安装因为PHP的<a href=\"@curl_url\">cURL</a>库不可用。','zh-hans',0,0,0),(3559,'测试框架未能安装因为PHP的<a href=\"@hash_url\">hash</a>扩展不可用。','zh-hans',0,0,0),(3560,'PHP open_basedir限制','zh-hans',0,0,0),(3561,'取消禁止IP地址','zh-hans',0,0,0),(3562,'禁止IP地址','zh-hans',0,0,0),(3563,'Statistics（统计）模块显示页面的访问频率、访客、访客上一次访问的页面（引用的链接），以及页面被浏览的时间。这些统计信息有助于确定访客是如何访问及在站点中导航的。更多信息，请查看<a href=\"@statistics\">Statistics模块</a>的在线手册条目。','zh-hans',0,0,0),(3564,'管理日志','zh-hans',0,0,0),(3565,'要启用统计数据的收集，必须勾选<a href=\"@statistics-settings\">统计设置</a>页面上的<em>启用日志访问</em>上的复选框。设置页面上的<em>丢弃以下时间的日志</em>用于指定日至条目在删除之前保留的时间。这个设置需要运行<a href=\"@cron\">cron维护任务</a>。','zh-hans',0,0,0),(3566,'查看站点使用情况','zh-hans',0,0,0),(3567,'统计模块有助于分析用户数据及了解用户使用站点的方式。此模块提供四个报告：','zh-hans',0,0,0),(3568,'<a href=\"@recent-hits\">最近点击</a>显示站点上最近的活动信息，包括访问页面的链接地址及标题，访客的用户名（若用）以及访客的IP地址。','zh-hans',0,0,0),(3569,'<a href=\"@top-referrers\">外部来源排行</a>显示访客都是从什么地方过来的（来源URL地址）。','zh-hans',0,0,0),(3570,'<a href=\"@top-pages\">热门页面</a>显示最常被访问的以访问频率排序的页