hp\">更新脚本</a>。启用更新管理器模块来安装模块和主题。','zh-hans',0,0,0),(3709,'如果你升级了新版本的Drupal或升级了模块及主题，你需要运行<a href=\"@update-php\">更新脚本</a>。','zh-hans',0,0,0),(3710,'有两种类型的动作：简单及高级。简单动作不需要其他配置，自动排列在下面。高级动作需要创建并在使用前进行配置，因为它们有选项因此需要进行指定；比如，发送邮件到特定地址，或者取消包含特定词语的内容的发布。要创建一个高级动作，从下面的高级动作的下拉菜单选择一个动作然后点击<em>创建</em>按钮。','zh-hans',0,0,0),(3711,'高级动作提供了其他的配置选项可以在下方进行填写。推荐更改<em>描述</em>字段，这样可以更精确的辨认动作进行的操作。当分配动作到系统事件上时描述会显示在如触发器的模块中，因此描述最好尽可能的详尽（比如，可以设置为\"发邮件给审批组\"而非简单的\"发送邮件\"）。','zh-hans',0,0,0),(3712,'管理模块','zh-hans',0,0,0),(3713,'站点配置管理','zh-hans',0,0,0),(3714,'管理主题','zh-hans',0,0,0),(3715,'管理动作','zh-hans',0,0,0),(3716,'使用管理页面帮助','zh-hans',0,0,0),(3717,'使用网站维护模式','zh-hans',0,0,0),(3718,'查看站点报告','zh-hans',0,0,0),(3719,'屏蔽IP地址','zh-hans',0,0,0),(3720,'公共文件','zh-hans',0,0,0),(3721,'公共本地文件送达网络服务器。','zh-hans',0,0,0),(3722,'由 Drupal 提供的私有本地文件。','zh-hans',0,0,0),(3723,'临时文件','zh-hans',0,0,0),(3724,'上传和预览临时本地文件。','zh-hans',0,0,0),(3725,'更新模块','zh-hans',0,0,0),(3726,'更新主题','zh-hans',0,0,0),(3727,'SSH','zh-hans',0,0,0),(3728,'您的密码不会保存在数据库中，仅用于建立一个连接。','zh-hans',0,0,0),(3729,'该连接将建立在您的网络服务器和承载网络服务器文件的主机机器之间。在绝大多数情况下，这将是同一台机器，而 \"localhost\" 是正确的。','zh-hans',0,0,0),(3730,'配置您的<a href=\"@user-edit\">帐户时区设置</a>。','zh-hans',0,0,0),(3731,'选择所需的当地时间和时区。整个网站的日期和时间将使用这个时区显示。','zh-hans',0,0,0),(3732,'有可能的话您的时区设置将被自动检测。确认选择并点击保存。','zh-hans',0,0,0),(3733,'系统帮助','zh-hans',0,0,0),(3734,'目录 %directory 不存在因为未能创建。','zh-hans',0,0,0),(3735,'目录 %directory 已存在但不可写也不能设置成可写。','zh-hans',0,0,0),(3736,'若想发送邮件给原始文章的作者，可用此邮件地址发送或输入 [node:author:mail]、[comment:author:mail] 等。','zh-hans',0,0,0),(3737,'此消息将被发送。你可以包含如 [node:title]、[user:name] 和 [comment:body] 之类的占位符，这样每次发送的消息都会有所不同。不是所有的上下文中都有可用的占位符。','zh-hans',0,0,0),(3738,'显示给当前用户的消息。可以包含如 [node:title]、[user:name] 及 [comment:body] 之类的占位符，这样每次在发送的时候内容都会有所不同。不是所有的上下文都有可用的占位符。','zh-hans',0,0,0),(3739,'@zone：@date','zh-hans',0,0,0),(3740,'Powered by <a href=\"@poweredby\">Drupal</a>','zh-hans',0,0,0),(3741,'AHAH callback','zh-hans',0,0,0),(3742,'管理区块、内容类型、菜单等。','zh-hans',0,0,0),(3743,