nk\">添加词汇</a>.','zh-hans',0,0,0),(3787,'当前无以此术语归类的内容。','zh-hans',0,0,0),(3788,'有关分类术语的标识。','zh-hans',0,0,0),(3789,'有关分类词汇表的标识。','zh-hans',0,0,0),(3790,'Taxonomy（分类）模块用来对站点的内容进行归类。要对内容进行归类，就需要指定包含相关<em>术语</em>的<em>词汇表</em>，然后将这些词汇表指定到内容类型上。更多信息，请查看<a href=\"@taxonomy\">Taxonomy模块</a>的在线手册条目。','zh-hans',0,0,0),(3791,'创建词汇表','zh-hans',0,0,0),(3792,'具有足够<a href=\"@perm\">权限</a>的用户可以在<a href=\"@taxo\">分类</a>页面上创建<em>词汇表</em>及<em>术语</em>。页面上列出的术语可以进行拖曳管理，可以控制术语的顺序及在词汇表中的上下级关系。比如可以按照以下方式，通过风格使用术语及子术语对音乐进行划分：','zh-hans',0,0,0),(3793,'<em>词汇表</em>：Music','zh-hans',0,0,0),(3794,'<em>术语</em>：Jazz','zh-hans',0,0,0),(3795,'<em>子术语</em>：Swing','zh-hans',0,0,0),(3796,'<em>子术语</em>：Fusion','zh-hans',0,0,0),(3797,'<em>术语</em>：Rock','zh-hans',0,0,0),(3798,'<em>子术语</em>：Country rock','zh-hans',0,0,0),(3799,'<em>子术语</em>：Hard rock','zh-hans',0,0,0),(3800,'可以将一个子术语指定到多个父级术语上。比如：<em>fusion</em>就可以被指定到<em>rock</em>和<em>jazz</em>上。','zh-hans',0,0,0),(3801,'<em>自由标签的词汇表</em>中的词汇表可以在你创建及修改内容时逐步建立起来，这通常用作博客或比如相册之类的图像管理程序中。','zh-hans',0,0,0),(3802,'为内容类型分配词汇表','zh-hans',0,0,0),(3803,'在使用词汇表对内容进行归类前，新的分类词汇必须通过该<a href=\"@ctedit\">内容类型</a>的<em>管理字段</em>标签下添加进去。当添加一个分类字段，你选择使用一个<em>挂件</em>用来在内容编辑页面时输入分类信息：选择列表、复选框、单选按钮、或一个自动完成的字段（用来创建一个自由标签的词汇表）。在选择好字段类型和挂件后，在随后的<em>字段设置</em>页面上可以选择所需要的词汇表，选择其中一个还是多个术语，以及其他的一些设置。同一个词汇表可以添加到多个内容类型上，在管理字段页面上的\"添加已有字段\"就可以完成此操作。','zh-hans',0,0,0),(3804,'为内容分类','zh-hans',0,0,0),(3805,'在词汇表分配到内容类型上后，你就可以开始对内容进行分类了。在内容编辑或<a href=\"@addnode\">创建内容</a>时就会显示带有术语的字段了。','zh-hans',0,0,0),(3806,'通过术语查看列表及RSS源','zh-hans',0,0,0),(3807,'每个分类术语都会自动提供其归类的页面列表及相应的RSS源。比如，如果术语<em>country rock</em>的ID是123（当把鼠标放在那个术语的页面列表的链接地址上就可以在状态栏上看到这个数字），通过路径 <em>taxonomy/term/123</em> 就可以看到页面的列表。RSS源则会使用 <em>taxonomy/term/123/feed</em>（当你浏览那个列表时RSS的图标会自动显示在地址栏中）。','zh-hans',0,0,0),(3808,'扩展分类模块','zh-hans',0,0,0),(3809,'别忘了还有很多用户贡献的<a href=\"@taxcontrib\">模块</a>可以拓展分类模块在显示及组织术语方面的行为。','zh-hans',0,0,0),(3810,'分类用于内容的分类。术语由词汇表进行组织。比如，一个叫做 \"水果\" 的词汇表可能会包含术语 \"苹果\" 和 \"香蕉\"。','zh-hans',0,0,0),(3811,