9,'显示的最新日志的数量','zh-hans',0,0,0),(4130,'@node_type 评论','zh-hans',0,0,0),(4131,'编辑评论 %comment','zh-hans',0,0,0),(4132,'Field UI（字段界面）模块提供了管理化的用户界面，用于附加及管理字段。字段可以为内容项目及评论以内容类型级别进行指定，为分类术语以词汇表级别机型指定，以及为用户以站点级别进行指定。其他的模块也可能会为其数据指定字段。字段类型（文本、图像、数字等等）是由模块进行指定，由<a href=\"@field\">Field模块</a>进行收集和管理。更多信息，请查看<a href=\"@field_ui\" target=\"_blank\">Field UI模块</a>的在线手册条目。','zh-hans',0,0,0),(4133,'规划字段','zh-hans',0,0,0),(4134,'字段叫什么','zh-hans',0,0,0),(4135,'字段有一个<em>标签</em>（用户界面中显示的名称）以及一个<em>机器名</em>（内部使用的名称）。在字段创建之后标签如有需要是可以进行修改的，但是机器名在字段创建之后是不能进行更改的。','zh-hans',0,0,0),(4136,'存的是何种字段数据','zh-hans',0,0,0),(4137,'每个字段都会存储一种数据（文本、数字、文件等等）。当你指定一个数据的时候，你就会选择某一特定的<em>字段类型</em>，用来存储相应类型的数据。在字段创建之后，其数据类型是不能进行修改的。','zh-hans',0,0,0),(4138,'数据如何输入及显示','zh-hans',0,0,0),(4139,'字段会存多少值','zh-hans',0,0,0),(4140,'你可以存储一个或特定最大范围内的数值，或无限的数值。例如，员工的身份证号码字段可以用一个数字进行存储，电话号码字段可以存储多个电话号码。这些设置在字段创建之后是可以进行更改的，但是如果你减小某数值的最大额度，可能会丢失一些信息。','zh-hans',0,0,0),(4141,'重用字段','zh-hans',0,0,0),(4142,'一旦你指定了一个字段，你可以对其进行重用。比如，如果你为一个内容类型指定了一个自定义的图像字段，你还需要一个在其他内容类型上具有相同参数的图像字段，你可以将同样的字段添加到第二种内容类型上，可以在用户界面的<em>添加已有字段</em>区域进行添加。你也可以将此字段添加到一个分类词汇表，评论或用户帐户等上面。','zh-hans',0,0,0),(4143,'重用字段的一些设置和字段的用途相比是由区别的；一些设置可以在所有的地方共享使用。比如，文本字段的标签虽然不一样，但是对于数值的设置则是共享的。','zh-hans',0,0,0),(4144,'重用字段主要有两个原因：首先，重用字段可以节省定义字段所花费的时间。其次，重用字段也可以让你对内容类型进行显示、过滤、组织以及对内容排序。比如，用户贡献的Views模块就可以让你创建内容的列表和表格。所以如果你在多个内容类型上使用相同的字段，你可以创建一个包含所有这些内容类型的View，显示那个字段、按那个字段排序，及/或由那个字段进行过滤等。','zh-hans',0,0,0),(4145,'内容项目上的字段','zh-hans',0,0,0),(4146,'在内容项目上指定的字段是内容类型级别的，在内容类型编辑页面（访问<a href=\"@types\">内容类型</a>页面）上的<em>管理字段</em>标签。当你为一种内容类型指定字段时，那种类型的每个内容项目都会将那个字段添加进去。一些字段，比如标题和正文，会在创建一种内容类型时提供给你。','zh-hans',0,0,0),(4147,'分类术语上的字段','zh-hans',0,0,0),(4148,'为分类术语指定的字段是分类词汇表级别的，显示在词汇表编辑页面（访问<a href=\"@taxonomy\">分类词汇</a>页面）的<em>管理字段</em>标签上。当你为一个词汇表指定字段时，其中的每个术语都会将那个字段添加进去。比如，你在词汇表中指定一个图像字段来为其中的每个术语保存一个图标。','zh-hans',0,0,0),(4149,'用户帐户上的字段','zh-hans',0,0,0),(4150,'用户帐户上的字段是站点级别的，显示在<a href=\"@accounts\">帐户设置</a>页面的<a href=\"@fields\">管理字段</a>标签。当你为用户帐户指定一个字段时，每个用户帐户都会将那个字段添加进去。比如，你想添加一个长文本字段好让用户输入他们的自传。','zh-hans',0,0,0),(4151,'评论上的字段','zh-hans',0,0,0),(4152,'评论上的字段是内容类型级别的，显示在内容类型编辑页面（访问<a href=\"@types\">内容类型</a>页面）上的<em>评论字段</em>标签上。当你为评论添加一个字段时，那么每个内容项目的评论上都会将那个字段添加进去。比如，你想在论坛的评论中添加一个网站字段，在评论时显示一个链接到评论发布者的网站的链接。','zh-hans',0,0,0),(4153,'管理输入格式及过滤器','zh-hans',0,0,0),(4154,'@type语言检测','zh-hans',0,0,0),(4155,'上传文件中的字符串替换已有字符串，新字符串进行添加，复数格式会被更新。','zh-hans',0,0,0),(4156,'已有字符串及复数格式将会保留，只添加新字符串。','zh-hans',0,0,0),(4157,'确定显示页面元素的语言的方式（大多是由Drupal和模块提供的文本，比如字段标签和帮助文本）。这个决定可以由一系列语言检测方式来确定；第一个检测方式是获得用于输入文本的语言的结果。指定此页面上语言检测方式的的顺序。','zh-hans',0,0,0),(4158,'用户界面文本','zh-hans',0,0,0),(4159,'使用检测到的界面语言。','zh-hans',0,0,0),(4160,'添加新%type','zh-hans',0,0,0),(4161,'通过复制默认组的项目创建一组新的快捷方式。','zh-hans',0,0,0),(4162,'过复制 %default 组项目创建新快捷方式组。','zh-hans',0,0,0),(4163,'你当前正在使用 %set-name 快捷方式组。','zh-hans',0,0,0),(4164,'编辑组名','zh-hans',0,0,0),(4165,'删除组','zh-hans',0,0,0),(4166,'创建新组','zh-hans',0,0,0),(4167,'已创建 %set_name 快捷方式组。你可以在此页进行编辑。','zh-hans',0,0,0),(4168,'组名已更新为 %set-name。','zh-hans',0,0,0),(4169,'若你为一些或全部用户将此快捷方式组设为默认组，删除此组也将会影响到他们。','zh-hans',0,0,0),(4170,'确定要删除快捷方式组 %title？','zh-hans',0,0,0),(4171,'快捷方式组 %title 已被删除。','zh-hans',0,0,0),(4172,'1 个用户选择了或分配到此快捷方式组。','zh-hans',0,0,0),(4173,'@count 个用户选择了或分配到此快捷方式组。','zh-hans',4172,1,0),(4174,'Shortcut（快捷方式）模块让用户可以创建站点经常使用的页面的<em>快捷方式</em>组。快捷方式是包含在<em>组</em>里的。具有<em>选择任意快捷方式组</em>权限的用户可以选择站点上其他人创建的快捷方式。更多信息，请查看<a href=\"@shortcut\">Shortcut模块</a>的在线手册条目。','zh-hans',0,0,0),(4175,'管理快捷方式','zh-hans',0,0,0),(4176,'具有<em>管理快捷方式</em>权限的用户可以在<a href=\"@shortcuts\">快捷方式管理</a>页面管理快捷方式组及组中的快捷方式。','zh-hans',0,0,0),(4177,'正在选择快捷方式组','zh-hans',0,0,0),(4178,'具有切换快捷方式组的用户可以在其用户帐户页面中的快捷方式标签下选择要使用的快捷方式组。','zh-hans',0,0,0),(4179,'Shortcut （快捷方式）模块可以在你站点的页面上创建添加/删除的链接；这个链接使你可以将当前页面添加到你当前启用的快捷方式组（如果你的主题能够显示并你有编辑快捷方式组的权限）中。核心的 \'Seven\' 管理主题在页面标题旁显示那个链接，以小小的 + 或 - 符号显示。如果链接以 + 符号显示，你可以将页面添加到首选的快捷方式组中。如果那个页面已经是快捷方式了，那么那个链接会以 - 符号显示，这样可以将那个页面从快捷方式组中删除。','zh-hans',0,0,0),(4180,'指定在<a href=\"@shortcut-link\">快捷方式标签</a>上你使用的