CREATE TABLE `xiaozhushou_sydneytoday_rental_item` (
  `title` varchar(127) NOT NULL,
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `rid` int(11) NOT NULL,
  `url` varchar(255) NOT NULL,
  `contact` varchar(127) DEFAULT NULL,
  `mobile` varchar(255) DEFAULT NULL,
  `phone` varchar(255) DEFAULT NULL,
  `qq` varchar(255) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `property_type` varchar(31) DEFAULT NULL,
  `rental_type` varchar(31) DEFAULT NULL,
  `facilities` varchar(511) DEFAULT NULL,
  `price` varchar(31) DEFAULT NULL,
  `near_by_facilities` varchar(511) DEFAULT NULL,
  `address` varchar(511) DEFAULT NULL,
  `comment` blob,
  `images` text,
  `suburb` varchar(32) DEFAULT NULL,
  `published_at` int(11) NOT NULL DEFAULT '0' COMMENT 'Timestamp for when property was created.',
  `created_at` int(11) NOT NULL DEFAULT '0' COMMENT 'Timestamp for when property was crawed for the first time.',
  `crawed` int(11) NOT NULL DEFAULT '0',
  `imported` int(11) NOT NULL DEFAULT '0',
  `error` text,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `rid` (`rid`),
  KEY `email` (`email`),
  KEY `property_type` (`property_type`),
  KEY `rental_type` (`rental_type`),
  KEY `published_at` (`published_at`),
  KEY `suburb` (`suburb`)
) ENGINE=InnoDB AUTO_INCREMENT=60 DEFAULT CHARSET=utf8 COMMENT='Rental items on Sydneytoday rental section';
