INSERT INTO `xiaozhushou_sydneytoday_rental_item` VALUES ('Pyrmont $250 per/week',1,138382,'http://www.sydneytoday.com/bencandy.php?fid=12&id=138382','kevin',NULL,'<img src=\'http://www.sydneytoday.com/verify.php?uinfo=MDQzMjk5MDkwMA==\'>',NULL,'<img src=\'http://www.sydneytoday.com/verify.php?uinfo=a2V2aW4ucmVu\'>','Apartment','单间','包水/包电/包宽带/包煤气/床/洗衣机/空调/冰箱/微波炉/电视机/其它','$250 per/week','火车站/公车站/学校/超市/健身房/游泳池/其它','233 Harris Street, Pyrmont, New South Wales, Australia','  因为房客有事回国，房间22号可出租。全保安，近一切设施，离情人港2分钟。fish market 3分钟。China Town 15分钟。楼下有bus。\r\n\r\n房间内：入墙柜，单人床，书桌等。\r\n\r\n超友善房东\r\n\r\n水电煤全包。\r\n\r\n房子三房只住4人，家里同屋都爱安静。所以晚上不会吵。\r\n\r\n\r\n\r\n\r\n','http://www.sydneytoday.com/upload_files/fenlei/12/14179_20131217101249_h9hbn.jpg\nhttp://www.sydneytoday.com/upload_files/fenlei/12/14179_20131217101253_momzn.jpg\nhttp://www.sydneytoday.com/upload_files/fenlei/12/14179_20131217101256_y9u1a.jpg','Pyrmont',1387112400,1387760072,1,1,NULL),('',2,139619,'http://www.sydneytoday.com/bencandy.php?fid=12&id=139619','未注册用户','<img src=\'http://www.sydneytoday.com/verify.php?uinfo=MDQ1MDk5MTE5Mw==\'>',NULL,NULL,NULL,'Apartment','客厅',NULL,'',NULL,NULL,'\r\n','','Ultimo',1387717200,1387760072,1,1,NULL),('St Leonards $250 per/week',3,139005,'http://www.sydneytoday.com/bencandy.php?fid=12&id=139005','PAUL','<img src=\'http://www.sydneytoday.com/verify.php?uinfo=MDQxMDE2ODkwOQ==\'>',NULL,'674605982',NULL,'Apartment','单间','包水/床/洗衣机/空调/冰箱/微波炉','$250 per/week','火车站/公车站/学校/超市','8 Duntroon Avenue, St Leonards, New South Wales, Australia','  St Leonards 【北悉尼】【全新高档时尚公寓】 2012年完工\r\n\r\n&#8226; &#160;  &#160;两房一厅一卫，超大阳台\r\n&#8226; &#160;  &#160;大双人房出租： 单人$250，双人$280/w，长租短租都可以。\r\n&#8226; &#160;  (朝北，阳光充足，宽敞明亮舒适，无限流量宽带，新家具，新床垫，新家电，新空调)\r\n&#8226; &#160;  &#160;友善学生房东住另一间小房间。\r\n&#8226; &#160;  &#160;厨房客厅共用，客厅不住人，整套公寓只住你和他两个人。\r\n\r\n&#8226; &#160;  &#160; 距离火车站仅300米，3分钟一班火车\r\n&#8226; &#160;  &#160; 到 Chatswood 5分钟\r\n&#8226; &#160;  &#160; 到 City 15分钟\r\n&#8226; &#160;  &#160; 到 Macquarie Uni 